methods.description:
Creates a new instance of a <code>Component</code> or returns the instance of an existing <code>Component</code>.

If you want to look up an existing <code>Component</code> you can call this function with a Component ID as parameter: <pre>
  var oComponent = sap.ui.component(sComponentId);
</pre>

To create a new instance of a component you pass a component configuration object into this function: <pre>
  var oComponent = sap.ui.component({
    name: "my.Component",
    url: "my/component/location",
    id: "myCompId1"
  });
</pre>

Defines a JavaScript module with its ID, its dependencies and a module export value or factory.

The typical and only suggested usage of this method is to have one single, top level call to <code>sap.ui.define</code> in one JavaScript resource (file). When a module is requested by its module ID for the first time, the corresponding resource is determined from the ID and the current {@link sap.ui.loader.config configuration}. The resource will be loaded and executed which in turn will execute the top level <code>sap.ui.define</code> call.

If the module ID was omitted from that call, it will be substituted by the ID that was used to request the module. As a preparation step, the dependencies as well as their transitive dependencies, will be loaded. Then, the module value (its export) will be determined: if a static value (object, literal) was given as <code>vFactory</code>, that value will be the module value. If a function was given, that function will be called (providing the module exports of the declared dependencies as parameters to the function) and its return value will be used as module export value. The framework internally associates the resulting value with the module ID and provides it to the original requester of the module. Whenever the module is requested again, the same export value will be returned (modules are executed only once).

<i>Example:</i><br> The following example defines a module, but doesn't hard code the module ID. If stored in a file 'sap/mylib/SomeClass.js', it can be requested with the ID 'sap/mylib/SomeClass'. <pre>
  sap.ui.define(['./Helper', 'sap/m/Bar'], function(Helper,Bar) {

    // create a new class
    var SomeClass = function() {};

    // add methods to its prototype
    SomeClass.prototype.foo = function() {

        // use a function from the dependency 'Helper' in the same package (e.g. 'sap/mylib/Helper' )
        var mSettings = Helper.foo();

        // create and return an sap.m.Bar (using its local name 'Bar')
        return new Bar(mSettings);

    }

    // return the class as module value
    return SomeClass;

  });
</pre>

In another module or in an application HTML page, the {@link sap.ui.require} API can be used to load the sap/mylib/Something module and to work with it:

<pre>
sap.ui.require(['sap/mylib/Something'], function(Something) {

  // instantiate a Something and call foo() on it
  new Something().foo();

});
</pre>

<h3>Module Name Syntax</h3>

<code>sap.ui.define</code> uses a simplified variant of the {@link jQuery.sap.getResourcePath unified resource name} syntax for the module's own name as well as for its dependencies. The only difference to that syntax is, that for <code>sap.ui.define</code> and <code>sap.ui.require</code>, the extension (which always would be '.js') has to be omitted. Both methods always add this extension internally.

As a convenience, the name of a dependency can start with the segment './' which will be replaced by the name of the package that contains the currently defined module (relative name).

It is best practice to omit the name of the defined module (first parameter) and to use relative names for the dependencies whenever possible. This reduces the necessary configuration, simplifies renaming of packages and allows to map them to a different namespace.

<h3>Dependency to Modules</h3>

If a dependencies array is given, each entry represents the name of another module that the currently defined module depends on. All dependency modules are loaded before the export of the currently defined module is determined. The module export of each dependency module will be provided as a parameter to a factory function, the order of the parameters will match the order of the modules in the dependencies array.

<b>Note:</b> The order in which the dependency modules are <i>executed</i> is <b>not</b> defined by the order in the dependencies array! The execution order is affected by dependencies <i>between</i> the dependency modules as well as by their current state (whether a module already has been loaded or not). Neither module implementations nor dependents that require a module set must make any assumption about the execution order (other than expressed by their dependencies).

<b>Note:</b> A static module export (a literal provided to <code>sap.ui.define</code>) cannot depend on the module exports of the dependency modules as it has to be calculated before the dependencies are resolved. As an alternative, modules can define a factory function, calculate a static export value in that function, potentially based on the dependencies, and return the result as module export value. The same approach must be taken when the module export is supposed to be a function.

<h3>Asynchronous Contract</h3>

<code>sap.ui.define</code> is designed to support real Asynchronous Module Definitions (AMD) in future, although it internally still might use synchronous module loading, depending on configuration and context. However, callers of <code>sap.ui.define</code> must never rely on any synchronous behavior that they might observe in a specific test scenario.

For example, callers of <code>sap.ui.define</code> must not use the module export value immediately after invoking <code>sap.ui.define</code>:

<pre>
  // COUNTER EXAMPLE HOW __NOT__ TO DO IT

  // define a class Something as AMD module
  sap.ui.define('Something', [], function() {
    var Something = function() {};
    return Something;
  });

  // DON'T DO THAT!
  // accessing the class _synchronously_ after sap.ui.define was called
  new Something();

</pre>

Applications that need to ensure synchronous module definition or synchronous loading of dependencies <b>MUST</b> use the deprecated legacy APIs {@link jQuery.sap.declare} and {@link jQuery.sap.require}.

<h3>(No) Global References</h3>

To be in line with AMD best practices, modules defined with <code>sap.ui.define</code> should not make any use of global variables if those variables are also available as module exports. Instead, they should add dependencies to those modules and use the corresponding parameter of the factory function to access the module exports.

As the current programming model and the documentation of UI5 heavily rely on global names, there will be a transition phase where UI5 enables AMD modules and local references to module exports in parallel to the old global names. The fourth parameter of <code>sap.ui.define</code> has been added to support that transition phase. When this parameter is set to true, the framework provides two additional features

<ol> <li>Before the factory function is called, the existence of the global parent namespace for the current module is ensured</li> <li>The module export returned by the module's factory function will be automatically exported under the global name which is derived from the ID of the module</li> </ol>

The parameter lets the framework know whether any of those two operations is needed or not. In future versions of UI5, a central configuration option is planned to suppress those 'exports'.

<h3>Third Party Modules</h3> Although third party modules don't use UI5 APIs, they still can be listed as dependencies in a <code>sap.ui.define</code> call. They will be requested and executed like UI5 modules, but to make their exports available, so called <em>shims</em> have to be defined.

Note that UI5 temporarily deactivates an existing AMD loader while it executes third party modules known to support AMD. This sounds contradictorily at a first glance as UI5 wants to support AMD, but for now it is necessary to fully support UI5 applications that rely on global names for such modules.

For third-party modules that UI5 delivers (e.g. those in namespace <code>sap/ui/thirdparty/</code>), the necessary shims are defined by UI5 itself by executing the private module <code>ui5loader-autoconfig.js</code> during bootstrap.

Example: <pre>
  // module 'Something' wants to use third party library 'URI.js'
  // It is packaged by UI5 as non-UI5-module 'sap/ui/thirdparty/URI'
  // the following shim helps UI5 to correctly load URI.js and to retrieve the module's export value
  // Apps don't have to define that shim, it is already applied by ui5loader-autconfig.js
  sap.ui.loader.config({
    shim: {
      'sap/ui/thirdparty/URI': {
         amd: true, // URI.js reacts on an AMD loader, this flag lets UI5 temp. disable such loaders
         exports: 'URI' // name of the global variable under which URI.js exports its module value
      }
    }
  });

  // now the module can be retrieved like other modules
  sap.ui.define('Something', ['sap/ui/thirdparty/URI'], function(URIModuleValue) {

    new URIModuleValue(...); // same as the global 'URI' name: new URI(...)

    ...
  });
</pre>

<h3>Differences to Standard AMD</h3>

The current implementation of <code>sap.ui.define</code> differs from the AMD specification (https://github.com/amdjs/amdjs-api) or from concrete AMD loaders like <code>requireJS</code> in several aspects: <ul> <li>The name <code>sap.ui.define</code> is different from the plain <code>define</code>. This has two reasons: first, it avoids the impression that <code>sap.ui.define</code> is an exact implementation of an AMD loader. And second, it allows the coexistence of an AMD loader (e.g. requireJS) and <code>sap.ui.define</code> in one application as long as UI5 or applications using UI5 are not fully prepared to run with an AMD loader. Note that the difference of the API names also implies that the UI5 loader can't be used to load 'real' AMD modules as they expect methods <code>define</code> and <code>require</code> to be available. Modules that use Unified Module Definition (UMD) syntax, can be loaded, but only when no AMD loader is present or when they expose their export also to the global namespace, even when an AMD loader is present (as e.g. jQuery does) or when a shim is defined for them using the <code>amd:true</code> flag (see example above)</li> <li>Depending on configuration and the current context, <code>sap.ui.define</code> loads the dependencies of a module either synchronously using a sync XHR call + eval or asynchronously via script tags. The sync loading is basically a tribute to the synchronous history of UI5. There's no way for a module developer to enforce synchronous loading of the dependencies and on the long run, sync loading will be faded out. Applications that need to ensure synchronous loading of dependencies <b>MUST</b> use the deprecated legacy APIs like {@link jQuery.sap.require}.</li> <li><code>sap.ui.define</code> does not support plugins to use other file types, formats or protocols. It is not planned to support this in future</li> <li><code>sap.ui.define</code> does not support absolute URLs as module names (dependencies) nor does it allow module names that start with a slash. To refer to a module at an absolute URL, a resource root can be registered that points to that URL (or to a prefix of it).</li> <li><code>sap.ui.define</code> does <b>not</b> support the 'sugar' of requireJS where CommonJS style dependency declarations using <code>sap.ui.require("something")</code> are automagically converted into <code>sap.ui.define</code> dependencies before executing the factory function.</li> </ul>

<h3>Limitations, Design Considerations</h3> <ul> <li><b>Limitation</b>: as dependency management is not supported for Non-UI5 modules, the only way to ensure proper execution order for such modules currently is to rely on the order in the dependency array. Obviously, this only works as long as <code>sap.ui.define</code> uses synchronous loading. It will be enhanced when asynchronous loading is implemented.</li> <li>It was discussed to enforce asynchronous execution of the module factory function (e.g. with a timeout of 0). But this would have invalidated the current migration scenario where a sync <code>jQuery.sap.require</code> call can load a <code>sap.ui.define</code>'ed module. If the module definition would not execute synchronously, the synchronous contract of the require call would be broken (default behavior in existing UI5 applications)</li> <li>A single file must not contain multiple calls to <code>sap.ui.define</code>. Multiple calls currently are only supported in the so called 'preload' files that the UI5 merge tooling produces. The exact details of how this works might be changed in future implementations and are not part of the API contract</li> </ul>

Defines or creates an instance of a JavaScript view.

The behavior of this method depends on the signature of the call and on the current context.

<h3>View Definition</h3> <pre>
  sap.ui.jsview(sId, vView);
</pre> Defines a view of the given name with the given implementation. <code>sId</code> must be the view's name, <code>vView</code> must be an object and can contain implementations for any of the hooks provided by JSView.

<h3>View Instantiation (deprecated)</h3> <pre>
  var oView = sap.ui.jsview(vView);
  var oView = sap.ui.jsview(vView, bASync);
  var oView = sap.ui.jsview(sId, vView);
  var oView = sap.ui.jsview(sId, vView, bAsync);
</pre> Creates an instance of the view with the given name (and id). If no view implementation has been defined for that view name, a JavaScript module with the same qualified name and with suffix <code>.view.js</code> will be loaded (required) and executed. The module should register a view definition on execution (1st. variant above).

If <code>sId</code> is omitted, an ID will be created automatically.

When <code>bAsync</code> has a truthy value, the view definition will be read asynchronously, if needed, but the (incomplete) view instance will be returned immediately.

<b>Note:</b> Using <code>sap.ui.jsview</code> for creating view instances has been deprecated, use {@link sap.ui.core.mvc.JSView.create JSView.create} instead. <code>JSView.create</code> enforces asynchronous loading and can be used via an AMD reference, it doesn't rely on a global name.

<b>Note:</b> Any other call signature will lead to a runtime error.

Redirects access to resources that are part of the given namespace to a location relative to the assumed <b>application root folder</b>.

Any UI5 managed resource (view, controller, control, JavaScript module, CSS file, etc.) whose resource name starts with <code>sNamespace</code>, will be loaded from an equally named subfolder of the <b>application root folder</b>. If the resource name consists of multiple segments (separated by a dot), each segment is assumed to represent an individual folder. In other words: when a resource name is converted to a URL, any dots ('.') are converted to slashes ('/').

<b>Limitation:</b> For the time being, the <b>application root folder</b> is assumed to be the same as the folder where the current page resides in.

Usage sample: <pre>
  // Let UI5 know that resources, whose name starts with "com.mycompany.myapp"
  // should be loaded from the URL location "./com/mycompany/myapp"
  sap.ui.localResources("com.mycompany.myapp");

  // The following call implicitly will use the mapping done by the previous line
  // It will load a view from ./com/mycompany/myapp/views/Main.view.xml
  View.create({ viewName : "com.mycompany.myapp.views.Main", type : ViewType.XML}).then(function(oView) {
      // do stuff
  });
</pre>

When applications need a more flexible mapping between resource names and their location, they can use {@link jQuery.sap.registerModulePath}.

It is intended to make this configuration obsolete in future releases, but for the time being, applications must call this method when they want to store resources relative to the assumed application root folder.

Resolves one or more module dependencies.

<h3>Synchronous Retrieval of a Single Module Export Value (Probing)</h3>

When called with a single string, that string is assumed to be the ID of an already loaded module and the export of that module is returned. If the module has not been loaded yet, or if it is a Non-UI5 module (e.g. third-party module) without a shim, <code>undefined</code> is returned.

This signature variant allows synchronous access to module exports without initiating module loading.

Sample: <pre>
  var JSONModel = sap.ui.require("sap/ui/model/json/JSONModel");
</pre>

For modules that are known to be UI5 modules, this signature variant can be used to check whether the module has been loaded.

<h3>Asynchronous Loading of Multiple Modules</h3>

If an array of strings is given and (optionally) a callback function, then the strings are interpreted as module IDs and the corresponding modules (and their transitive dependencies) are loaded. Then the callback function will be called asynchronously. The module exports of the specified modules will be provided as parameters to the callback function in the same order in which they appeared in the dependencies array.

The return value for the asynchronous use case is <code>undefined</code>.

<pre>
  sap.ui.require(['sap/ui/model/json/JSONModel', 'sap/ui/core/UIComponent'], function(JSONModel,UIComponent) {

    var MyComponent = UIComponent.extend('MyComponent', {
      ...
    });
    ...

  });
</pre>

This method uses the same variation of the {@link jQuery.sap.getResourcePath unified resource name} syntax that {@link sap.ui.define} uses: module names are specified without the implicit extension '.js'. Relative module names are not supported.

Creates a Template for the given ID, DOM reference or a configuration object.

If no parameter is defined, this function makes a lookup of DOM elements which are specifying a type attribute. If the value of this type attribute matches a registered type then the content of this DOM element will be used to create a new <code>Template</code> instance.

If you want to lookup all kind of existing and known templates and parse them directly you can simply call: <pre>
  sap.ui.template();
</pre>

To parse a concrete DOM element you can do so by using this function in the following way: <pre>
  sap.ui.template("theTemplateId");
</pre>

Or you can pass the reference to a DOM element and use this DOM element as a source for the template: <pre>
  sap.ui.template(oDomRef);
</pre>

The last option to use this function is to pass the information via a configuration object. This configuration object can be used to pass a context for the templating framework when compiling the template: <pre>
  var oTemplateById = sap.ui.template({
    id: "theTemplateId",
    context: { ... }
  });

  var oTemplateByDomRef = sap.ui.template({
    domref: oDomRef,
    context: { ... }
  });
</pre>

It can also be used to load a template from another file: <pre>
  var oTemplate = sap.ui.template({
    id: "myTemplate",
    src: "myTemplate.tmpl"
  });

  var oTemplateWithContext = sap.ui.template({
    id: "myTemplate",
    src: "myTemplate.tmpl",
    context: { ... }
  });
</pre>

Derives a new type from a given base type.

Example:<br> <pre>

  var fooType = DataType.createType('foo', {
      isValid : function(vValue) {
          return /^(foo(bar)?)$/.test(vValue);
      }
  }, DataType.getType('string'));

  fooType.isValid('foo'); // true
  fooType.isValid('foobar'); // true
  fooType.isValid('==foobar=='); // false

</pre>

If <code>mSettings</code> contains an implementation for <code>isValid</code>, then the validity check of the newly created type will first execute the check of the base type and then call the given <code>isValid</code> function.

Array types and enumeration types cannot be created with this method. They're created on-the-fly by {@link #.getType DataType.getType} when such a type is looked up.

<b>Note:</b> The creation of new primitive types is not supported. When a type is created without a base type, it is automatically derived from the primitive type <code>any</code>.

<b>Note:</b> If a type has to be used in classes tagged with <code>@ui5-metamodel</code>, then the implementation of <code>isValid</code> must exactly have the structure shown in the example above (single return statement, regular expression literal of the form <code>/^(...)$/</code>, calling <code>/regex/.test()</code> on the given value). Only the inner part of the regular expression literal can be different.

Binds a property to the model.

The Setter for the given property will be called with the value retrieved from the data model. When the binding mode is <code>OneTime</code>, the property will be set only once. When it is <code>OneWay</code>, the property will be updated whenever the corresponding data in the model changes. In mode <code>TwoWay</code>, changes to the property (not originating in the model) will be reported back to the model (typical use case: user interaction changes the value of a control).

This is a generic method which can be used to bind any property to the model. A managed object may flag any property in its metadata with <code>bindable="bindable"</code> to additionally provide named methods to bind and unbind the corresponding property.

<b>Composite Binding</b><br> A composite property binding which combines data from multiple model paths can be declared using the <code>parts</code> parameter instead of <code>path</code>. The <code>formatter</code> function or a {@link sap.ui.model.CompositeType composite type} then can be used to combine the parts, Properties with a composite binding are also known as "calculated fields".

Example: <pre>
  oTxt.bindValue({
    parts: [
      {path: "/firstName", type: "sap.ui.model.type.String"},
      {path: "myModel2>/lastName"}
    ]
  });
</pre>

Note that a composite binding will be forced into mode <code>OneWay</code> when one of the binding parts is not in mode <code>TwoWay</code>.

<b>Formatter Functions</b><br> When a formatter function is specified for the binding or for a binding part, it will be called with the value of the bound model property. After setting the initial property value, the formatter function will only be called again when the bound model property changes (simple property binding) or when at least one of the bound model properties changes (formatter function of a composite binding). Note that a binding only monitors the bound model data for changes. Dependencies of the formatter implementation to other model data is not known to the binding and changes won't be detected.

When the formatter for a property binding (simple or composite) is called, the managed object will be given as <code>this</code> context. For formatters of binding parts in a composite binding, this is not the case.

Defines a new subclass of ManagedObject with name <code>sClassName</code> and enriches it with the information contained in <code>oClassInfo</code>.

<code>oClassInfo</code> can contain the same information that {@link sap.ui.base.Object.extend} already accepts, plus the following new properties in the 'metadata' object literal:

<ul> <li><code>library : <i>string</i></code></li> <li><code>properties : <i>object</i></code></li> <li><code>defaultProperty : <i>string</i></code></li> <li><code>aggregations : <i>object</i></code></li> <li><code>defaultAggregation : <i>string</i></code></li> <li><code>associations : <i>object</i></code></li> <li><code>events : <i>object</i></code></li> <li><code>specialSettings : <i>object</i></code>// this one is still experimental and not for public usage!</li> </ul>

Each of these properties is explained in more detail lateron.

Example: <pre>
ManagedObect.extend('sap.mylib.MyClass', {
  metadata : {
    library: 'sap.mylib',
    properties : {
      value: 'string',
      width: 'sap.ui.core.CSSSize',
      height: { type: 'sap.ui.core.CSSSize', defaultValue: '100%'}
      description: { type: 'string', defaultValue: '', selector: '#{id}-desc'}
    },
    defaultProperty : 'value',
    aggregations : {
      header : { type: 'sap.mylib.FancyHeader', multiple : false }
      items : 'sap.ui.core.Control',
      buttons: { type: 'sap.mylib.Button', multiple : true, selector: '#{id} > .sapMLButtonsSection'}
    },
    defaultAggregation : 'items',
    associations : {
      initiallyFocused : { type: 'sap.ui.core.Control' }
    },
    events: {
      beforeOpen : {
        parameters : {
          opener : { type: 'sap.ui.core.Control' }
        }
      }
    },
  },

  init: function() {
  }

}); // end of 'extend' call
</pre>

Detailed explanation of properties<br>

<b>'library'</b> : <i>string</i><br> Name of the library that the new subclass should belong to. If the subclass is a control or element, it will automatically register with that library so that authoring tools can discover it. By convention, the name of the subclass should have the library name as a prefix, e.g. 'sap.ui.commons.Panel' belongs to library 'sap.ui.commons'.

<b>'properties'</b> : <i>object</i><br> An object literal whose properties each define a new managed property in the ManagedObject subclass. The value can either be a simple string which then will be assumed to be the type of the new property or it can be an object literal with the following properties <ul> <li><code>type: <i>string</i></code> type of the new property. Must either be one of the built-in types 'string', 'boolean', 'int', 'float', 'object' or 'any', or a type created and registered with {@link sap.ui.base.DataType.createType} or an array type based on one of the previous types.</li> <li><code>group:<i>string</i></code> a semantic grouping of the properties, intended to be used in design time tools. Allowed values are (case sensitive): Accessibility, Appearance, Behavior, Data, Designtime, Dimension, Identification, Misc</li> <li><code>defaultValue: <i>any</i></code> the default value for the property or null if there is no defaultValue.</li> <li><code>bindable: <i>boolean|string</i></code> (either can be omitted or set to the boolean value <code>true</code> or the magic string 'bindable') If set to <code>true</code> or 'bindable', additional named methods <code>bind<i>Name</i></code> and <code>unbind<i>Name</i></code> are generated as convenience. Despite its name, setting this flag is not mandatory to make the managed property bindable. The generic methods {@link #bindProperty} and {@link #unbindProperty} can always be used. </li> <li><code>selector: <i>string</i></code> Optional; can be set to a valid CSS selector (as accepted by the {@link https://developer.mozilla.org/en-US/docs/Web/API/Element/querySelector Element.prototype.querySelector} method). When set, it locates the DOM element that represents this property's value. It should only be set for properties that have a visual text representation in the DOM.

The purpose of the selector is to allow other framework parts or design time tooling to identify the DOM parts of a control or element that represent a specific property without knowing the control or element implementation in detail.

As an extension to the standard CSS selector syntax, the selector string can contain the placeholder <code>{id}</code> (multiple times). Before evaluating the selector in the context of an element or control, all occurrences of the placeholder have to be replaced by the (potentially escaped) ID of that element or control. In fact, any selector should start with <code>#{id}</code> to ensure that the query result is limited to the desired element or control.

<b>Note</b>: there is a convenience method {@link sap.ui.core.Element#getDomRefForSetting} that evaluates the selector in the context of a concrete element or control instance. It also handles the placeholder <code>{id}</code>. Only selected framework features may use that private method, it is not yet a public API and might be changed or removed in future versions of UI5. However, instead of maintaining the <code>selector</code> in the metadata, element and control classes can overwrite <code>getDomRefForSetting</code> and determine the DOM element dynamically.</li> </ul> Property names should use camelCase notation, start with a lowercase letter and only use characters from the set [a-zA-Z0-9_$]. If an aggregation in the literal is preceded by a JSDoc comment (doclet) and if the UI5 plugin and template are used for JSDoc3 generation, the doclet will be used as generic documentation of the aggregation.

For each public property 'foo', the following methods will be created by the "extend" method and will be added to the prototype of the subclass: <ul> <li>getFoo() - returns the current value of property 'foo'. Internally calls {@link #getProperty}</li> <li>setFoo(v) - sets 'v' as the new value of property 'foo'. Internally calls {@link #setProperty}</li> <li>bindFoo(c) - (only if property was defined to be 'bindable'): convenience function that wraps {@link #bindProperty}</li> <li>unbindFoo() - (only if property was defined to be 'bindable'): convenience function that wraps {@link #unbindProperty}</li> </ul>

<b>'defaultProperty'</b> : <i>string</i><br> When specified, the default property must match the name of one of the properties defined for the new subclass (either own or inherited). The named property can be used to identify the main property to be used for bound data. E.g. the value property of a field control.

<b>'aggregations'</b> : <i>object</i><br> An object literal whose properties each define a new aggregation in the ManagedObject subclass. The value can either be a simple string which then will be assumed to be the type of the new aggregation or it can be an object literal with the following properties <ul> <li><code>type: <i>string</i></code> type of the new aggregation. must be the full global name of a ManagedObject subclass (in dot notation, e.g. 'sap.m.Button')</li> <li><code>[multiple]: <i>boolean</i></code> whether the aggregation is a 0..1 (false) or a 0..n aggregation (true), defaults to true </li> <li><code>[singularName]: <i>string</i></code>. Singular name for 0..n aggregations. For 0..n aggregations the name by convention should be the plural name. Methods affecting multiple objects in an aggregation will use the plural name (e.g. getItems(), whereas methods that deal with a single object will use the singular name (e.g. addItem). The framework knows a set of common rules for building plural form of English nouns and uses these rules to determine a singular name on its own. if that name is wrong, a singluarName can be specified with this property. </li> <li><code>[visibility]: <i>string</i></code> either 'hidden' or 'public', defaults to 'public'. Aggregations that belong to the API of a class must be 'public' whereas 'hidden' aggregations typically are used for the implementation of composite classes (e.g. composite controls) </li> <li><code>bindable: <i>boolean|string</i></code> (either can be omitted or set to the boolean value <code>true</code> or the magic string 'bindable') If set to <code>true</code> or 'bindable', additional named methods <code>bind<i>Name</i></code> and <code>unbind<i>Name</i></code> are generated as convenience. Despite its name, setting this flag is not mandatory to make the managed aggregation bindable. The generic methods {@link #bindAggregation} and {@link #unbindAggregation} can always be used. </li> <li><code>forwarding: <i>object</i></code> If set, this defines a forwarding of objects added to this aggregation into an aggregation of another ManagedObject - typically to an inner control within a composite control. This means that all adding, removal, or other operations happening on the source aggregation are actually called on the target instance. All elements added to the source aggregation will be located at the target aggregation (this means the target instance is their parent). Both, source and target element will return the added elements when asked for the content of the respective aggregation. If present, the named (non-generic) aggregation methods will be called for the target aggregation. Aggregations can only be forwarded to non-hidden aggregations of the same or higher multiplicity (i.e. an aggregation with multiplicity "0..n" cannot be forwarded to an aggregation with multiplicity "0..1"). The target aggregation must also be "compatible" to the source aggregation in the sense that any items given to the source aggregation must also be valid in the target aggregation (otherwise the target element will throw a validation error). If the forwarded elements use data binding, the target element must be properly aggregated by the source element to make sure all models are available there as well. The aggregation target must remain the same instance across the entire lifetime of the source control. Aggregation forwarding will behave unexpectedly when the content in the target aggregation is modified by other actors (e.g. by the target element or by another forwarding from a different source aggregation). Hence, this is not allowed. The forwarding configuration object defines the target of the forwarding. The available settings are: <ul> <li><code>idSuffix: <i>string</i></code>A string which is appended to the ID of <i>this</i> ManagedObject to construct the ID of the target ManagedObject. This is one of the two options to specify the target. This option requires the target instance to be created in the init() method of this ManagedObject and to be always available.</li> <li><code>getter: <i>string</i></code>The name of the function on instances of this ManagedObject which returns the target instance. This second option to specify the target can be used for lazy instantiation of the target. Note that either idSuffix or getter must be given. Also note that the target instance returned by the getter must remain the same over the entire lifetime of this ManagedObject and the implementation assumes that all instances return the same type of object (at least the target aggregation must always be defined in the same class).</li> <li><code>aggregation: <i>string</i></code>The name of the aggregation on the target into which the objects shall be forwarded. The multiplicity of the target aggregation must be the same as the one of the source aggregation for which forwarding is defined.</li> <li><code>[forwardBinding]: <i>boolean</i></code>Whether any binding should happen on the forwarding target or not. Default if omitted is <code>false</code>, which means any bindings happen on the outer ManagedObject. When the binding is forwarded, all binding methods like updateAggregation, getBindingInfo, refreshAggregation etc. are called on the target element of the forwarding instead of being called on this element. The basic aggregation mutator methods (add/remove etc.) are only called on the forwarding target element. Without forwardBinding, they are called on this element, but forwarded to the forwarding target, where they actually modify the aggregation. </li> </ul> </li> <li><code>selector: <i>string</i></code> Optional; can be set to a valid CSS selector (as accepted by the {@link https://developer.mozilla.org/en-US/docs/Web/API/Element/querySelector Element.prototype.querySelector} method). When set, it locates the DOM element that surrounds the aggregation's content. It should only be set for aggregations that have a visual representation in the DOM. A DOM element surrounding the aggregation's rendered content should be available in the DOM, even if the aggregation is empty or not rendered for some reason. In cases where this is not possible or not intended, <code>getDomRefForSetting</code> can be overridden, see below.

The purpose of the selector is to allow other framework parts like drag and drop or design time tooling to identify those DOM parts of a control or element that represent a specific aggregation without knowing the control or element implementation in detail.

As an extension to the standard CSS selector syntax, the selector string can contain the placeholder <code>{id}</code> (multiple times). Before evaluating the selector in the context of an element or control, all occurrences of the placeholder have to be replaced by the (potentially escaped) ID of that element or control. In fact, any selector should start with <code>#{id}</code> to ensure that the query result is limited to the desired element or control.

<b>Note</b>: there is a convenience method {@link sap.ui.core.Element#getDomRefForSetting} that evaluates the selector in the context of a concrete element or control instance. It also handles the placeholder <code>{id}</code>. Only selected framework features may use that private method, it is not yet a public API and might be changed or removed in future versions of UI5. However, instead of maintaining the <code>selector</code> in the metadata, element and control classes can overwrite <code>getDomRefForSetting</code> to calculate or add the appropriate DOM Element dynamically.</li> </li> </ul> Aggregation names should use camelCase notation, start with a lowercase letter and only use characters from the set [a-zA-Z0-9_$]. The name for a hidden aggregations might start with an underscore. If an aggregation in the literal is preceded by a JSDoc comment (doclet) and if the UI5 plugin and template are used for JSDoc3 generation, the doclet will be used as generic documentation of the aggregation.

For each public aggregation 'item' of cardinality 0..1, the following methods will be created by the "extend" method and will be added to the prototype of the subclass: <ul> <li>getItem() - returns the current value of aggregation 'item'. Internally calls {@link #getAggregation} with a default value of <code>undefined</code></li> <li>setItem(o) - sets 'o' as the new aggregated object in aggregation 'item'. Internally calls {@link #setAggregation}</li> <li>destroyItem(o) - destroy a currently aggregated object in aggregation 'item' and clears the aggregation. Internally calls {@link #destroyAggregation}</li> <li>bindItem(c) - (only if aggregation was defined to be 'bindable'): convenience function that wraps {@link #bindAggregation}</li> <li>unbindItem() - (only if aggregation was defined to be 'bindable'): convenience function that wraps {@link #unbindAggregation}</li> </ul> For a public aggregation 'items' of cardinality 0..n, the following methods will be created: <ul> <li>getItems() - returns an array with the objects contained in aggregation 'items'. Internally calls {@link #getAggregation} with a default value of <code>[]</code></li> <li>addItem(o) - adds an object as last element in the aggregation 'items'. Internally calls {@link #addAggregation}</li> <li>insertItem(o,p) - inserts an object into the aggregation 'items'. Internally calls {@link #insertAggregation}</li> <li>indexOfItem(o) - returns the position of the given object within the aggregation 'items'. Internally calls {@link #indexOfAggregation}</li> <li>removeItem(v) - removes an object from the aggregation 'items'. Internally calls {@link #removeAggregation}</li> <li>removeItems() - removes all objects from the aggregation 'items'. Internally calls {@link #removeAllAggregation}</li> <li>destroyItems() - destroy all currently aggregated objects in aggregation 'items' and clears the aggregation. Internally calls {@link #destroyAggregation}</li> <li>bindItems(c) - (only if aggregation was defined to be 'bindable'): convenience function that wraps {@link #bindAggregation}</li> <li>unbindItems() - (only if aggregation was defined to be 'bindable'): convenience function that wraps {@link #unbindAggregation}</li> </ul> For private or hidden aggregations, no methods are generated.

<b>'defaultAggregation'</b> : <i>string</i><br> When specified, the default aggregation must match the name of one of the aggregations defined for the new subclass (either own or inherited). The named aggregation will be used in contexts where no aggregation is specified. E,g. when an object in an XMLView embeds other objects without naming an aggregation, as in the following example: <pre>
 &lt;!-- assuming the defaultAggregation for Dialog is 'content' -->
 &lt;Dialog>
   &lt;Text/>
   &lt;Button/>
 &lt;/Dialog>
</pre>

<b>'associations'</b> : <i>object</i><br> An object literal whose properties each define a new association of the ManagedObject subclass. The value can either be a simple string which then will be assumed to be the type of the new association or it can be an object literal with the following properties <ul> <li><code>type: <i>string</i></code> type of the new association</li> <li><code>multiple: <i>boolean</i></code> whether the association is a 0..1 (false) or a 0..n association (true), defaults to false(1) for associations</li> <li><code>[singularName]: <i>string</i></code>. Singular name for 0..n associations. For 0..n associations the name by convention should be the plural name. Methods affecting multiple objects in an association will use the plural name (e.g. getItems(), whereas methods that deal with a single object will use the singular name (e.g. addItem). The framework knows a set of common rules for building plural form of English nouns and uses these rules to determine a singular name on its own. if that name is wrong, a singluarName can be specified with this property.</li> </ul> Association names should use camelCase notation, start with a lowercase letter and only use characters from the set [a-zA-Z0-9_$]. If an association in the literal is preceded by a JSDoc comment (doclet) and if the UI5 plugin and template are used for JSDoc3 generation, the doclet will be used as generic documentation of the association.

For each association 'ref' of cardinality 0..1, the following methods will be created by the "extend" method and will be added to the prototype of the subclass: <ul> <li>getRef() - returns the current value of association 'item'. Internally calls {@link #getAssociation} with a default value of <code>undefined</code></li> <li>setRef(o) - sets 'o' as the new associated object in association 'item'. Internally calls {@link #setAssociation}</li> </ul> For a public association 'refs' of cardinality 0..n, the following methods will be created: <ul> <li>getRefs() - returns an array with the objects contained in association 'items'. Internally calls {@link #getAssociation} with a default value of <code>[]</code></li> <li>addRef(o) - adds an object as last element in the association 'items'. Internally calls {@link #addAssociation}</li> <li>removeRef(v) - removes an object from the association 'items'. Internally calls {@link #removeAssociation}</li> <li>removeAllRefs() - removes all objects from the association 'items'. Internally calls {@link #removeAllAssociation}</li> </ul>

<b>'events'</b> : <i>object</i><br> An object literal whose properties each define a new event of the ManagedObject subclass. The value can either be a simple string which then will be assumed to be the type of the new association or it can be an object literal with the following properties <ul> <li><code>allowPreventDefault: <i>boolean</i></code> whether the event allows to prevented the default behavior of the event source</li> <li><code>parameters: <i>object</i></code> an object literal that describes the parameters of this event. </li> </ul> Event names should use camelCase notation, start with a lower-case letter and only use characters from the set [a-zA-Z0-9_$]. If an event in the literal is preceded by a JSDoc comment (doclet) and if the UI5 plugin and template are used for JSDoc3 generation, the doclet will be used as generic documentation of the event.

For each event 'Some' the following methods will be created by the "extend" method and will be added to the prototype of the subclass: <ul> <li>attachSome(fn,o) - registers a listener for the event. Internally calls {@link #attachEvent}</li> <li>detachSome(fn,o) - deregisters a listener for the event. Internally calls {@link #detachEvent}</li> <li>fireSome() - fire the event. Internally calls {@link #fireEvent}</li> </ul>

<b>'specialSettings'</b> : <i>object</i><br> Special settings are an experimental feature and MUST NOT BE DEFINED in controls or applications outside of the <code>sap.ui.core</code> library. There's no generic or general way how to set or get the values for special settings. For the same reason, they cannot be bound against a model. If there's a way for consumers to define a value for a special setting, it must be documented in the class that introduces the setting.

examples.text:
ComboBox.getMetadata().forwardAggregation(
   "items",
   {
       idSuffix: "-internalList", // internal control with the ID <control id> + "-internalList" must always exist after init() has been called
       aggregation: "listItems"
   }
);

ComboBox.getMetadata().forwardAggregation(
   "items",
   {
       getter: ComboBox.prototype._getInternalList, // the function returning (and instantiating if needed) the target list at runtime
       aggregation: "listItems"
   }
);

methods.description:
Applies the support for custom style classes on the prototype of a <code>sap.ui.core.Element</code>.

All controls (subclasses of <code>sap.ui.core.Control</code>) provide the support custom style classes. The control API provides functions to the application which allow it to add, remove or change style classes for the control. In general, this option is not available for elements because elements do not necessarily have a representation in the DOM.

This function can be used by a control developer to explicitly enrich the API of his/her element implementation with the API functions for the custom style class support. It must be called on the prototype of the element.

<b>Usage Example:</b> <pre>
sap.ui.define(['sap/ui/core/Element', 'sap/ui/core/CustomStyleClassSupport'], function(Element, CustomStyleClassSupport) {
   "use strict";
   var MyElement = Element.extend("my.MyElement", {
      metadata : {
         //...
      }
      //...
   });

   CustomStyleClassSupport.apply(MyElement.prototype);

   return MyElement;
}, true);
</pre>

Furthermore, the function <code>oRenderManager.writeClasses(oElement);</code> ({@link sap.ui.core.RenderManager#writeClasses}) must be called within the renderer of the control to which the element belongs, when writing the root tag of the element. This ensures the classes are written to the HTML.

This function adds the following functions to the elements prototype: <ul> <li><code>addStyleClass</code>: {@link sap.ui.core.Control#addStyleClass}</li> <li><code>removeStyleClass</code>: {@link sap.ui.core.Control#removeStyleClass}</li> <li><code>toggleStyleClass</code>: {@link sap.ui.core.Control#toggleStyleClass}</li> <li><code>hasStyleClass</code>: {@link sap.ui.core.Control#hasStyleClass}</li> </ul> In addition the clone function of the element is extended to ensure that the custom style classes are also available on the cloned element.

<b>Note:</b> This function can only be used <i>within</i> control development. An application cannot add style class support on existing elements by calling this function.

properties.description:
Callback handler which will be executed once a component instance has been created by {#link sap.ui.component}. The component instance and the configuration object will be passed into the registered function. For async scenarios (<code>vConfig.async = true</code>) a Promise can be provided as return value from the callback handler to delay resolving the Promise returned by {@link sap.ui.component}. In synchronous scenarios the return value will be ignored.

Example usage: <pre>
sap.ui.require(['sap/ui/core/Component'], function(Component) {
  Component._fnOnInstanceCreated = function(oComponent, oConfig) {
    // do some logic with the config

    // optionally return a Promise
    return doAsyncStuff();
  };
});
</pre> <b>ATTENTION:</b> This hook must only be used by UI flexibility (library: sap.ui.fl) and will be replaced with a more generic solution!

