methods.description:
Creates a nested component that is declared in the <code>sap.ui5/componentUsages</code> section of the descriptor (manifest.json). The following snippet shows the declaration: <pre>
{
  [...]
  "sap.ui5": {
    "componentUsages": {
      "myUsage": {
        "name": "my.useful.Component"
      }
    }
  }
  [...]
}
</pre> The syntax of the configuration object of the component usage matches the configuration object of the {#link sap.ui.component} factory function.

This is an example of how the <code>createComponent</code> function can be used for asynchronous scenarios: <pre>
oComponent.createComponent("myUsage").then(function(oComponent) {
  oComponent.doSomething();
}).catch(function(oError) {
  Log.error(oError);
});
</pre>

The following example shows how <code>createComponent</code> can be used to create a nested component by providing specific properties like <code>id</code>, <code>async</code>, <code>settings</code>, or <code>componentData</code>: <pre>
var oComponent = oComponent.createComponent({
  usage: "myUsage",
  id: "myId",
  settings: { ... },
  componentData: { ... }
});
</pre> The allowed list of properties are defined in the parameter documentation of this function.

The properties can also be defined in the descriptor. These properties can be overwritten by the local properties of that function.

Returns a service interface for the {@link sap.ui.core.service.Service Service} declared in the descriptor for components (manifest.json). The declaration needs to be done in the <code>sap.ui5/services</code> section as follows: <pre>
{
  [...]
  "sap.ui5": {
    "services": {
      "myLocalServiceAlias": {
        "factoryName": "my.ServiceFactory",
        ["optional": true]
      }
    }
  }
  [...]
}
</pre> The service declaration is used to define a mapping between the local alias for the service that can be used in the Component and the name of the service factory which will be used to create a service instance.

The <code>getService</code> function will look up the service factory and will create a new instance by using the service factory function {@link sap.ui.core.service.ServiceFactory#createInstance createInstance} The optional property defines that the service is not mandatory and the usage will not depend on the availability of this service. When requesting an optional service the <code>getService</code> function will reject but there will be no error logged in the console.

When creating a new instance of the service the Component context will be passed as <code>oServiceContext</code> as follows: <pre>
{
  "scopeObject": this,     // the Component instance
  "scopeType": "component" // the stereotype of the scopeObject
}
</pre>

The service will be created only once per Component and reused in future calls to the <code>getService</code> function. <p> This function will return a <code>Promise</code> which provides the service interface when resolved. If the <code>factoryName</code> could not be found in the {@link sap.ui.core.service.ServiceFactoryRegistry Service Factory Registry} or the service declaration in the descriptor for components (manifest.json) is missing the Promise will reject.

This is an example of how the <code>getService</code> function can be used: <pre>
oComponent.getService("myLocalServiceAlias").then(function(oService) {
  oService.doSomething();
}).catch(function(oError) {
  Log.error(oError);
});
</pre>

examples.text:
sap.ui.getCore().getConfiguration().applySettings({
    language: 'de',
    calendarType: sap.ui.core.CalendarType.Gregorian,
    formatSettings: {
        legacyDateFormat: '1',
        legacyTimeFormat: '1',
        legacyNumberFormat: '1'
    }
});

methods.description:
This function (if available on the concrete control) provides the current accessibility state of the control.

Applications must not call this hook method directly, it is called by the framework.

Subclasses of Control should implement this hook to provide any necessary accessibility information:

<pre>
MyControl.prototype.getAccessibilityInfo = function() {
   return {
     role: "textbox",      // String which represents the WAI-ARIA role which is implemented by the control.
     type: "date input",   // String which represents the control type (Must be a translated text). Might correlate with
                           // the role.
     description: "value", // String which describes the most relevant control state (e.g. the inputs value). Must be a
                           // translated text.
                           // Note: The type and the enabled/editable state must not be handled here.
     focusable: true,      // Boolean which describes whether the control can get the focus.
     enabled: true,        // Boolean which describes whether the control is enabled. If not relevant it must not be set or
                           // <code>null</code> can be provided.
     editable: true,       // Boolean which describes whether the control is editable. If not relevant it must not be set or
                           // <code>null</code> can be provided.
     children: []          // Aggregations of the given control (e.g. when the control is a layout). Primitive aggregations will be ignored.
                           // Note: Children should only be provided when it is helpful to understand the accessibility context
                           //       (e.g. a form control must not provide details of its internals (fields, labels, ...) but a
                           //       layout should).
   };
};
</pre>

Note: The returned object provides the accessibility state of the control at the point in time when this function is called.

symbols.description:
Core Class of the SAP UI Library.

This class boots the Core framework and makes it available for the application via method <code>sap.ui.getCore()</code>.

Example: <pre>

  var oCore = sap.ui.getCore();

</pre>

With methods of the Core framework you can {@link #attachInit execute code} after the framework has been initialized. It provides access to the {@link #getConfiguration configuration} and exposes events that an application or a control can register to (e.g. {@link #event:localizationChanged localizationChanged}, {@link #event:parseError parseError}, {@link #event:validationError validationError}, {@link #event:formatError formatError}, {@link #event:validationSuccess validationSuccess}).

Example: <pre>

  oCore.attachInit(function() {
    if ( oCore.getConfiguration().getRTL() ) {
      ...
    }
  });

  oCore.attachLocalizationChanged(function(oEvent) {
    ...
  });

</pre>

methods.description:
Creates a component with the provided id and settings.

When the optional parameter <code>sUrl</code> is given, then all request for resources of the library will be redirected to the given URL. This is convenience for a call to <pre>
  sap.ui.loader.config({
      paths: {
        "lib/with/slashes": vUrl
      }
  });
</pre>

Loads the given library and its dependencies and makes it available to the application.

When library preloads are not suppressed for the given library, then a library-preload bundle will be loaded for it. By default, the bundle will be loaded synchronously (for compatibility reasons). Only when the optional parameter <code>vUrl</code> is given as <code>true</code> or as a configuration object with a property of <code>async:true</code>, then the bundle will be loaded asynchronously and a <code>Promise</code> will be returned (preferred usage).

After preloading the bundle, dependency information from the bundle is evaluated and any missing libraries are also preloaded.

Only then the library entry module (named <code><i>your/lib</i>/library.js</code>) will be required and executed. The module is supposed to call <code>sap.ui.getCore().initLibrary(...)</code> providing the framework with additional metadata about the library, e.g. its version, the set of contained enums, types, interfaces, controls and elements and whether the library requires CSS. If the library requires CSS, a &lt;link&gt; will be added to the page referring to the corresponding <code>library.css</code> stylesheet for the library and the current theme.

When the optional parameter <code>vUrl</code> is given as a string or when a configuration object is given with a non-empty, string-valued property <code>url</code>, then that URL will be registered for the namespace of the library and all resources will be loaded from that location. This is convenience for a call like <pre>
  sap.ui.loader.config({
    paths: {
      "lib/with/slashes": vUrl
    }
  });
</pre>

When the given library has been loaded already, no further action will be taken, especially, a given URL will not be registered! In the case of asynchronous loading, a Promise will be returned, but will be resolved immediately.

Sets the disabled modifiers These modifiers will not be handled by the <code>ItemNavigation</code>

<pre>
Example: Disable shift + up handling of the <code>ItemNavigation</code>

oItemNavigation.setDisabledModifiers({
    sapnext : ["shift"]
});

Possible keys are : "shift", "alt", "ctrl", "meta"
Possible events are : "sapnext", "sapprevious", "saphome", "sapend"
</pre>

Defines a new subclass of Element with the name <code>sClassName</code> and enriches it with the information contained in <code>oClassInfo</code>.

<code>oClassInfo</code> can contain the same information that {@link sap.ui.base.ManagedObject.extend} already accepts, plus the following <code>dnd</code> property to configure drag-and-drop behavior in the metadata object literal:

Example: <pre>
Element.extend('sap.mylib.MyElement', {
  metadata : {
    library : 'sap.mylib',
    properties : {
      value : 'string',
      width : 'sap.ui.core.CSSSize'
    },
    dnd : { draggable: true, droppable: false },
    aggregations : {
      items : { type: 'sap.ui.core.Control', multiple : true, dnd : {draggable: false, dropppable: true, layout: "Horizontal" } },
      header : {type : "sap.ui.core.Control", multiple : false, dnd : true },
    }
  }
});
</pre>

<h3><code>dnd</code> key as a metadata property</h3>

<b>dnd</b>: <i>object|boolean</i><br> Defines draggable and droppable configuration of the element. The following keys can be provided via <code>dnd</code> object literal to configure drag-and-drop behavior of the element: <ul> <li><code>[draggable=false]: <i>boolean</i></code> Defines whether the element is draggable or not. The default value is <code>false</code>.</li> <li><code>[droppable=false]: <i>boolean</i></code> Defines whether the element is droppable (it allows being dropped on by a draggable element) or not. The default value is <code>false</code>.</li> </ul> If <code>dnd</code> property is of type Boolean, then the <code>draggable</code> and <code>droppable</code> configuration are set to this Boolean value.

<h3><code>dnd</code> key as an aggregation metadata property</h3>

<b>dnd</b>: <i>object|boolean</i><br> In addition to draggable and droppable configuration, the layout of the aggregation can be defined as a hint at the drop position indicator. <ul> <li><code>[layout="Vertical"]: </code> The arrangement of the items in this aggregation. This setting is recommended for the aggregation with multiplicity 0..n (<code>multiple: true</code>). Possible values are <code>Vertical</code> (e.g. rows in a table) and <code>Horizontal</code> (e.g. columns in a table). It is recommended to use <code>Horizontal</code> layout if the arrangement is multidimensional.</li> </ul>

symbols.description:
This class provides methods for evaluating the possibility of using browser-native hyphenation or initializing and using a third-party hyphenation module.

<h3>Overview</h3> By using this API, a developer can check if browser-native hyphenation is supported for a particular language.

When browser-native hyphenation is not supported or if otherwise required, the API can be used to hyphenate texts. A third-party library "Hyphenopoly" is used in that case.

It is used internally by controls that support the <code>wrappingType:{@link sap.m.WrappingType WrappingType.Hyphenated}</code> property.

As the class is singleton, an instance should be acquired from {@link sap.ui.core.hyphenation.Hyphenation#sap.ui.core.hyphenation.Hyphenation.getInstance Hyphenation#getInstance}.

<h3>Usage</h3> <h4>When to use:</h4> <ul> <li>To check if browser-native hyphenation is available for particular language.</li> <li>To hyphenate texts if browser-native hyphenation is not available.</li> </ul> <h4>When not to use:</h4> <ul> <li> If the use case is covered by controls that support the property <code>wrappingType:{@link sap.m.WrappingType WrappingType.Hyphenated}</code>. This functionality is supported by {@link sap.m.Title sap.m.Title}, {@link sap.m.Label sap.m.Label} and {@link sap.m.Text sap.m.Text}. </li> <li>If browser-native hyphenation is available</li> </ul>

<h3>Example</h3> <pre>
if (!Hyphenation.getInstance().canUseNativeHyphenation("en")) {
	Hyphenation.getInstance().initialize("en").then(function() {
		console.log(Hyphenation.getInstance().hyphenate("An example text to hyphenate.", "en"));
	});
}
</pre>

For more information, see {@link topic:6322164936f047de941ec522b95d7b70 Hyphenation for Text Controls}.

<code>Caution:</code> Note that as the hyphenation feature uses third-party and browser-native tools, we are not responsible for any grammatical incorrectness or inconsistencies of the hyphenation. Also, the variety of supported languages is outside the scope of our control and may be subject to future changes.

examples.text:
Hyphenation.getInstance().initialize("en").then(function() {
	console.log(Hyphenation.getInstance().hyphenate("An example text to hyphenate.", "en"));
});

methods.description:
Registers a callback module, which provides code enhancements for the lifecycle and event handler functions of a specific controller. The code enhancements are returned either in sync or async mode.

The extension provider module provides the <code>getControllerExtensions</code> function which returns either directly an array of objects or a Promise that returns an array of objects when it resolves. These objects are object literals defining the methods and properties of the controller in a similar way as {@link sap.ui.controller}.

<b>Example for a callback module definition (sync):</b> <pre>
sap.ui.define("my/custom/sync/ExtensionProvider", ['jquery.sap.global'], function(jQuery) {
  var ExtensionProvider = function() {};
  ExtensionProvider.prototype.getControllerExtensions = function(sControllerName, sComponentId, bAsync) {
    if (!bAsync && sControllerName == "my.own.Controller") {
      // IMPORTANT: only return extensions for a specific controller
      return [{
        onInit: function() {
          // Do something here...
        },
        onAfterRendering: function() {
          // Do something here...
        },
        onButtonClick: function(oEvent) {
          // Handle the button click event
        }
      }
    }];
  };
  return ExtensionProvider;
}, true);
</pre>

<b>Example for a callback module definition (async):</b> <pre>
sap.ui.define("my/custom/async/ExtensionProvider", ['jquery.sap.global'], function(jQuery) {
  var ExtensionProvider = function() {};
  ExtensionProvider.prototype.getControllerExtensions = function(sControllerName, sComponentId, bAsync) {
    if (bAsync && sControllerName == "my.own.Controller") {
      // IMPORTANT:
      // only return a Promise for a specific controller since it
      // requires the View/Controller and its parents to run in async
      // mode!
      return new Promise(function(fnResolve, fnReject) {
        fnResolve([{
          onInit: function() {
            // Do something here...
          },
          onAfterRendering: function() {
            // Do something here...
          },
          onButtonClick: function(oEvent) {
            // Handle the button click event
          }
        }]);
      }
    };
  };
  return ExtensionProvider;
}, true);
</pre>

The lifecycle functions <code>onInit</code>, <code>onExit</code>, <code>onBeforeRendering</code> and <code>onAfterRendering</code> are added before or after the lifecycle functions of the original controller. The event handler functions, such as <code>onButtonClick</code>, are replacing the original controller's function.

When using an async extension provider you need to ensure that the view is loaded in async mode.

In both cases, return <code>undefined</code> if no controller extension shall be applied.

symbols.description:
Popup Class is a helper class for controls that want themselves or parts of themselves or even other aggregated or composed controls or plain HTML content to popup on the screen like menues, dialogs, drop down boxes.

It allows the controls to be aligned to other dom elements using the {@link sap.ui.core.Popup.Dock} method. With it you can define where the popup should be docked. One can dock the popup to the top bottom left or right side of a dom ref.

In the case that the popup has no space to show itself in the view port of the current window it tries to open itself to the inverted direction.

<strong>Since 1.12.3</strong> it is possible to add further DOM-element-ids that can get the focus when 'autoclose' is enabled. E.g. the RichTextEditor with running TinyMCE uses this method to be able to focus the Popups of the TinyMCE if the RichTextEditor runs within a Popup/Dialog etc.

To provide an additional DOM-element that can get the focus the following should be done: // create an object with the corresponding DOM-id var oObject = { id : "this_is_the_most_valuable_id_of_the_DOM_element" };

// add the event prefix for adding an element to the ID of the corresponding Popup var sEventId = "sap.ui.core.Popup.addFocusableContent-" + oPopup.getId();

// fire the event with the created event-id and the object with the DOM-id sap.ui.getCore().getEventBus().publish("sap.ui", sEventId, oObject);

methods.description:
Creates a new static renderer class that extends a given renderer.

This method can be used with two signatures that are explained below. In both variants, the returned renderer class inherits all properties (methods, fields) from the given parent renderer class. Both variants also add an 'extend' method to the created renderer class that behaves like the new signature of this <code>Renderer.extend</code> method, but creates subclasses of the new class, not of <code>sap.ui.core.Renderer</code>.

<b>New Signature</b><br> In the new signature variant, two parameters must be given: a qualified name for the new renderer (its class name), and an optional object literal that contains methods or fields to be added to the new renderer class.

This signature has been designed to resemble the class extension mechanism as provided by {@link sap.ui.base.Object.extend Object.extend}.

<pre>
sap.ui.define(['sap/ui/core/Renderer'],
    function(Renderer) {
    "use strict";

    var LabelRenderer = Renderer.extend('sap.m.LabelRenderer', {
        render: function(oRM, oControl) {

            renderPreamble(oRM, oControl);

            // implementation core renderer logic here

            renderPostamble(oRM, oControl);

        },

        renderPreamble : function(oRM, oControl) {
        ...
        },

        renderPostamble : function(oRM, oControl) {
        ...
        }

    });

    return LabelRenderer;
});
</pre>

The extension of Renderers works across multiple levels. A FancyLabelRenderer can extend the above LabelRenderer:

<pre>
sap.ui.define(['sap/m/LabelRenderer'],
    function(LabelRenderer) {
    "use strict";

    var FancyLabelRenderer = LabelRenderer.extend('sap.mylib.FancyLabelRenderer', {
        render: function(oRM, oControl) {

            // call base renderer
            LabelRenderer.renderPreamble(oRM, oControl);

            // ... do your own fancy rendering here

            // call base renderer again
            LabelRenderer.renderPostamble(oRM, oControl);
        }
    });

    return FancyLabelRenderer;
});
</pre>

<b>Note:</b> the new signature no longer requires the <code>bExport</code> flag to be set for the enclosing {@link sap.ui.define} call. The Renderer base class takes care of the necessary global export of the renderer. This allows Non-SAP developers to write a renderer that complies with the documented restriction for <code>sap.ui.define</code> (no use of bExport = true outside sap.ui.core projects).

<b>Deprecated Signature</b><br> The deprecated old signature expects just one parameter: a renderer that should be extended. With that signature the renderer can't be exported globally as the name of the renderer class is not known.

For compatibility reasons, the class created by the deprecated signature contains a property <code>_super</code> that references the parent class. It shouldn't be used by applications / control developers as it doesn't work reliably for deeper inheritance chains: if the old variant of <code>Renderer.extend</code> is used on two or more levels of the inheritance hierarchy, the <code>_super</code> property of the resulting renderer class will always point to the implementation of the base renderer of the last call to extend. Instead of using <code>this._super</code>, renderer implementations should use the new signature variant and access the base implementation of a method via the AMD reference to the base renderer (as shown in the FancyLabelRenderer example above).

Cleans up the rendering state of the given control without rendering it.

A control is responsible for the rendering of all its child controls. But in some cases it makes sense that a control only renders a subset of its children based on some criterion. For example, a typical carousel control might, for performance reasons, only render the currently visible children (and maybe some child before and after the visible area to facilitate slide-in / slide-out animations), but not all children. This leads to situations where a child had been rendered before, but shouldn't be rendered anymore after an update of the carousel's position. The DOM related state of that child then must be cleaned up correctly, e.g. by de-registering resize handlers or native event handlers. <code>cleanupControlWithoutRendering</code> helps with that task by triggering the same activities that the normal rendering triggers before the rendering of a control (e.g. it fire the <code>BeforeRendering</code> event). It just doesn't call the renderer and the control will not receive an <code>AfterRendering</code> event.

The following example shows how <code>renderControl</code> and <code>cleanupControlWithoutRendering</code> should be used:

<pre>
  CarouselRenderer.render = function(rm, oCarousel){

    ...

    oCarousel.getPages().forEach( oPage ) {
       if ( oCarousel.isPageToBeRendered( oPage ) ) {
          rm.renderControl( oPage ); // onBeforeRendering, render, later onAfterRendering
       } else {
          rm.cleanupControlWithoutRendering( oPage ); // onBeforeRendering
       }
    }

    ...

  };
</pre>

<h3>DOM Removal</h3> The method does not remove the DOM of the given control. The caller of this method has to take care to remove it at some later point in time. It should indeed be <i>later</i>, not <i>before</i> as the <code>onBeforeRendering</code> hook of the control might need access to the old DOM for a proper cleanup.

For parents which are rendered with the normal mechanism as shown in the example above, the removal of the old child DOM is guaranteed. The whole DOM of the parent control (including the DOM of the no longer rendered child) will be replaced with new DOM (no longer containing the child) when the rendering cycle finishes.

<b>Note:</b>: the functionality of this method is different from the default handling for invisible controls (controls with <code>visible == false</code>). The standard rendering for invisible controls still renders a placeholder DOM. This allows re-rendering of the invisible control once it becomes visible again without a need to render its parent, too. Children that are cleaned up with this method here, are supposed to have no more DOM at all. Rendering them later on therefore requires an involvement (typically: a rendering) of their parent.

Renders the content of the rendering buffer into the provided DOM node.

This function must not be called within control renderers.

Usage: <pre>

  // Create a new instance of the RenderManager
  var rm = sap.ui.getCore().createRenderManager();

  // Use the writer API to fill the buffers
  rm.write(...);
  rm.renderControl(oControl);
  rm.write(...);
  ...

  // Finally flush the buffer into the provided DOM node (The current content is removed)
  rm.flush(oDomNode);

  // If the instance is not needed anymore, destroy it
  rm.destroy();

</pre>

Writes necessary invisible control/element placeholder data into the HTML.

Controls should use this method only if the standard implementation of the RenderManager doesn't fit their needs. That standard implementation renders an invisible &lt;span&gt; element for controls with <code>visible:false</code> to improve re-rendering performance. Due to the fault tolerance of the HTML5 standard, such &lt;span&gt; elements are accepted in many scenarios and won't appear in the render tree of the browser, However, in some cases, controls may need to write a different element when the &lt;span&gt; is not an allowed element (e.g. within the &lt;tr&gt; or &lt;li&gt; group).

The caller needs to start an opening HTML tag, then call this method, then complete the opening and closing tag.

<pre>

  oRenderManager.write("&lt;tr");
  oRenderManager.writeInvisiblePlaceholderData(oControl);
  oRenderManager.write("&gt;&lt;/tr");

</pre>

parameters.description:
may contain many Route configurations as {@link sap.ui.core.routing.Route#constructor}.<br/> Each of the routes contained in the array/object will be added to the router.<br/>

One way of defining routes is an array: <pre>
[
    //Will create a route called 'firstRouter' you can later use this name in navTo to navigate to this route
    {
        name: "firstRoute"
        pattern : "usefulPattern"
    },
    //Will create a route called 'anotherRoute'
    {
        name: "anotherRoute"
        pattern : "anotherPattern"
    }
]
</pre>

The alternative way of defining routes is an Object. If you choose this way, the name attribute is the name of the property. <pre>
{
    //Will create a route called 'firstRouter' you can later use this name in navTo to navigate to this route
    firstRoute : {
        pattern : "usefulPattern"
    },
    //Will create a route called 'anotherRoute'
    anotherRoute : {
        pattern : "anotherPattern"
    }
}
</pre> The values that may be provided are the same as in {@link sap.ui.core.routing.Route#constructor}

Default values for route configuration - also takes the same parameters as {@link sap.ui.core.routing.Target#constructor}.<br/> This config will be used for routes and for targets, used in the router<br/> Eg: if the config object specifies : <pre>
<code>
{
    viewType : "XML"
}
</code>
</pre> The targets look like this: <pre>
{
    xmlTarget : {
        ...
    },
    jsTarget : {
        viewType : "JS"
        ...
    }
}
</pre> Then the effective config will look like this: <pre>
{
    xmlTarget : {
        viewType : "XML"
        ...
    },
    jsTarget : {
        viewType : "JS"
        ...
    }
}
</pre>

Since the xmlTarget does not specify its viewType, XML is taken from the config object. The jsTarget is specifying it, so the viewType will be JS.

available @since 1.28 the target configuration, see {@link sap.ui.core.routing.Targets#constructor} documentation (the options object).<br/> You should use Targets to create and display views. Since 1.28 the route should only contain routing relevant properties.<br/> <b>Example:</b> <pre>
<code>
    new Router(
    // Routes
    [
        {
            // no view creation related properties are in the route
            name: "startRoute",
            //no hash
            pattern: "",
            // you can find this target in the targetConfig
            target: "welcome"
        }
    ],
    // Default values shared by routes and Targets
    {
        viewNamespace: "my.application.namespace",
        viewType: "XML"
    },
    // You should only use this constructor when you are not using a router with a component.
    // Please use the metadata of a component to define your routes and targets.
    // The documentation can be found here: {@link sap.ui.core.UIComponent.extend}.
    null,
    // Target config
    {
         //same name as in the route called 'startRoute'
         welcome: {
             // All properties for creating and placing a view go here or in the config
             viewName: "Welcome",
             controlId: "app",
             controlAggregation: "pages"
         }
    })
</code>
</pre>

config.description:
this config allows all the values oOptions.targets.anyName allows, these will be the default values for properties used in the target.<br/> For example if you are only using xmlViews in your app you can specify viewType="XML" so you don't have to repeat this in every target.<br/> If a target specifies viewType="JS", the JS will be stronger than the XML here is an example.

<pre>
<code>
{
    config: {
        viewType : "XML"
    }
    targets : {
        xmlTarget : {
            ...
        },
        jsTarget : {
            viewType : "JS"
            ...
        }
    }
}
</code>
</pre> Then the effective config that will be used looks like this: <pre>
<code>
{
    xmlTarget : {
        // coming from the defaults
        viewType : "XML"
        ...
    },
    jsTarget : {
       // XML is overwritten by the "JS" of the targets property
       viewType : "JS"
      ...
    }
}
</code>
</pre>

viewName.description:
The name of a view that will be created. To place the view into a Control use the controlAggregation and controlId. Views will only be created once per viewName. <pre>
<code>
{
    targets: {
        // If display("masterWelcome") is called, the master view will be placed in the 'MasterPages' of a control with the id splitContainter
        masterWelcome: {
            viewName: "Welcome",
            controlId: "splitContainer",
            controlAggregation: "masterPages"
        },
        // If display("detailWelcome") is called after the masterWelcome, the view will be removed from the master pages and added to the detail pages, since the same instance is used. Also the controls inside of the view will have the same state.
        detailWelcome: {
            // same view here, that's why the same instance is used
            viewName: "Welcome",
            controlId: "splitContainer",
            controlAggregation: "detailPages"
        }
    }
}
</code>
</pre>

If you want to have a second instance of the welcome view you can use the following:

<pre>
<code>
// Some code you execute before you display the taget named 'detailWelcome':
View.create({ viewName : "Welcome", type : sap.ui.core.mvc.ViewType.XML}).then(function(oView) {
    oTargets.getViews().setView("WelcomeWithAlias", oView);
});

{
    targets: {
        // If display("masterWelcome") is called, the master viewName will be placed in the 'MasterPages' of a control with the id splitContainter
        masterWelcome: {
            viewName: "Welcome",
            controlId: "splitContainer",
            controlAggregation: "masterPages"
        },
        // If display("detailWelcome") is called after the masterWelcome, a second instance with an own controller instance will be added in the detail pages.
        detailWelcome: {
            // same viewName here, that's why the same instance is used
            viewName: "WelcomeWithAlias",
            controlId: "splitContainer",
            controlAggregation: "detailPages"
        }
    }
}
</code>
</pre>

parent.description:
A reference to another target, using the name of the target. If you display a target that has a parent, the parent will also be displayed. Also the control you specify with the controlId parameter, will be searched inside of the view of the parent not in the rootView, provided in the config. The control will be searched using the byId function of a view. When it is not found, the global id is checked. <br/> The main usecase for the parent property is placing a view inside a smaller container of a view, which is also created by targets. This is useful for lazy loading views, only if the user really navigates to this part of your application. <br/> <b>Example:</b> Our aim is to lazy load a tab of an IconTabBar (a control that displays a view initially and when a user clicks on it the view changes). It's a perfect candidate to lazy load something inside of it. <br/> <b>Example app structure:</b><br/> We have a rootView that is returned by the createContent function of our UIComponent. This view contains an sap.m.App control with the id 'myApp' <pre>
<code>
&lt;View xmlns="sap.m"&gt;
    &lt;App id="myApp"/&gt;
&lt;/View&gt;
</code>
</pre> an xml view called 'Detail' <pre>
<code>
&lt;View xmlns="sap.m"&gt;
    &lt;IconTabBar&gt;
        &lt;items&gt;
            &lt;IconTabFilter&gt;
                &lt;!-- content of our first tab --&gt;
            &lt;IconTabFilter&gt;
            &lt;IconTabFilter id="mySecondTab"&gt;
                &lt;!-- nothing here, since we will lazy load this one with a target --&gt;
            &lt;IconTabFilter&gt;
        &lt;/items&gt;
    &lt;/IconTabBar&gt;
&lt;/View&gt;
</code>
</pre> and a view called 'SecondTabContent', this one contains our content we want to have lazy loaded. Now we need to create our Targets instance with a config matching our app: <pre>
<code>
    new Targets({
        //Creates our views except for root, we created this one before - when using a component you
        views: new Views(),
        config: {
            // all of our views have that type
            viewType: 'XML',
            // a reference to the app control in the rootView created by our UIComponent
            controlId: 'myApp',
            // An app has a pages aggregation where the views need to be put into
            controlAggregation: 'pages'
        },
        targets: {
            detail: {
                viewName: 'Detail'
            },
            secondTabContent: {
                // A reference to the detail target defined above
                parent: 'detail',
                // A reference to the second Tab container in the Detail view. Here the target does not look in the rootView, it looks in the Parent view (Detail).
                controlId: 'mySecondTab',
                // An IconTabFilter has an aggregation called content so we need to overwrite the pages set in the config as default.
                controlAggregation: 'content',
                // A view containing the content
                viewName: 'SecondTabContent'
            }
        }
    });
</code>
</pre>

Now if we call <code> oTargets.display("secondTabContent") </code>, 2 views will be created: Detail and SecondTabContent. The 'Detail' view will be put into the pages aggregation of the App. And afterwards the 'SecondTabContent' view will be put into the content Aggregation of the second IconTabFilter. So a parent will always be created before the target referencing it.

anyName.description:
a new target, the key severs as a name. An example: <pre>
<code>
{
    targets: {
        welcome: {
            viewName: "Welcome",
            viewType: "XML",
            ....
            // Other target parameters
        },
        goodbye: {
            viewName: "Bye",
            viewType: "JS",
            ....
            // Other target parameters
        }
    }
}
</code>
</pre>

This will create two targets named 'welcome' and 'goodbye' you can display both of them or one of them using the {@link #display} function.

symbols.description:
A service provides a specific functionality. A service instance can be obtained by a {@link sap.ui.core.service.ServiceFactory ServiceFactory} or at a Component via {@link sap.ui.core.Component#getService getService} function.

This class is the abstract base class for services and needs to be extended: <pre>
sap.ui.define("my/Service", [
  "sap/ui/core/service/Service"
], function(Service) {

  return Service.extend("my.Service", {

    init: function() {
      // handle init lifecycle
    },

    exit: function() {
      // handle exit lifecycle
    },

    doSomething: function() {
      // some functionality
    }

 });

});
</pre>

A service instance will have a service context: <pre>
{
  "scopeObject": oComponent, // the Component instance
  "scopeType": "component"   // the stereotype of the scopeObject
}
</pre>

The service context can be retrieved with the function <code>getContext</code>. This function is private to the service instance and will not be exposed via the service interface.

For consumers of the service it is recommended to provide the service instance only - as e.g. the {@link sap.ui.core.Component#getService getService} function of the Component does. The service interface can be accessed via the <code>getInterface</code> function.

Other private functions of the service instance are the lifecycle functions. Currently there are two lifecycle functions: <code>init</code> and <code>exit</code>. In addition the <code>destroy</code> function will also by hidden to avoid the control of the service lifecycle for service interface consumers.

A service factory is used to create service instances for a specific context. The service factory needs to be registered in a central {@link sap.ui.core.service.ServiceFactoryRegistry service factory registry}. Consumers of services require the service factory to create service instances.

The service factory base class can be used in a generic way to act as a factory for any service: <pre>
sap.ui.require([
  "sap/ui/core/service/ServiceFactoryRegistry",
  "sap/ui/core/service/ServiceFactory",
  "my/Service"
], function(ServiceFactoryRegistry, ServiceFactory, MyService) {

  ServiceFactoryRegistry.register(new ServiceFactory(MService));

});
</pre>

Additionally a concrete service factory can be implemented by extending the service factory base class if additional functionality is needed when creating new instances for a specific context: <pre>
sap.ui.define("my/ServiceFactory", [
  "sap/ui/core/service/ServiceFactoryRegistry",
  "sap/ui/core/service/ServiceFactory",
  "my/Service"
], function(ServiceFactoryRegistry, ServiceFactory, MyService) {

  return ServiceFactory.extend("my.ServiceFactory", {
    createInstance: function(oServiceContext) {
      return Promise.resolve(new MyService(oServiceContext));
    }
  });

});
</pre>

Another option for the usage of the service factory is to provide a structured object with information about the service which will create an anonymous service internally: <pre>
sap.ui.define("my/ServiceFactory", [
  "sap/ui/core/service/ServiceFactoryRegistry",
  "sap/ui/core/service/ServiceFactory",
  "my/Service"
], function(ServiceFactoryRegistry, ServiceFactory, MyService) {

  return new ServiceFactory({

    init: function() { ... },
    exit: function() { ... },

    doSomething: function() { ... }

  });

});
</pre>

As <code>createInstance</code> returns a <code>Promise</code> e.g. the service module can also be loaded asynchronously and resolve once the module has been loaded and instantiated.

methods.description:
Returns the content of {@link sap.ui.core.UIComponent#createContent}. If you specified a <code>rootView</code> in your metadata or in the descriptor file (manifest.json), you will get the instance of the root view. This getter will only return something if the {@link sap.ui.core.UIComponent#init} function was invoked. If <code>createContent</code> is not implemented, and there is no root view, it will return <code>null</code>. Here is an example: <code> <pre>
         var MyExtension = UIComponent.extend("my.Component", {
              metadata: {
                   rootView: "my.View"
              },
              init: function () {
                   this.getRootControl(); // returns null
                   UIComponent.prototype.init.apply(this, arguments);
                   this.getRootControl(); // returns the view "my.View"
              }
         });
    </pre> </code>

symbols.description:
Context interface provided by XML template processing as an additional first argument to any formatter function which opts in to this mechanism. Candidates for such formatter functions are all those used in binding expressions which are evaluated during XML template processing, including those used inside template instructions like <code>&lt;template:if></code>. The formatter function needs to be marked with a property <code>requiresIContext = true</code> to express that it requires this extended signature (compared to ordinary formatter functions). The usual arguments are provided after the first one (currently: the raw value from the model).

This interface provides callback functions to access the model and path which are needed to process OData V4 annotations. It initially offers a subset of methods from {@link sap.ui.model.Context} so that formatters might also be called with a context object for convenience, e.g. outside of XML template processing (see below for an exception to this rule).

<b>Example:</b> Suppose you have a formatter function called "foo" like below and it is used within an XML template like <code>&lt;template:if test="{path: '...', formatter: 'foo'}"></code>. In this case <code>foo</code> is called with arguments <code>oInterface, vRawValue</code> such that <code>oInterface.getModel().getObject(oInterface.getPath()) === vRawValue</code> holds. <pre>
window.foo = function (oInterface, vRawValue) {
    //TODO ...
};
window.foo.requiresIContext = true;
</pre>

<b>Composite Binding Examples:</b> Suppose you have the same formatter function and it is used in a composite binding like <code>&lt;Text text="{path: 'Label', formatter: 'foo'}: {path: 'Value', formatter: 'foo'}"/></code>. In this case <code>oInterface.getPath()</code> refers to ".../Label" in the 1st call and ".../Value" in the 2nd call. This means each formatter call knows which part of the composite binding it belongs to and behaves just as if it was an ordinary binding.

Suppose your formatter is not used within a part of the composite binding, but at the root of the composite binding in order to aggregate all parts like <code> &lt;Text text="{parts: [{path: 'Label'}, {path: 'Value'}], formatter: 'foo'}"/></code>. In this case <code>oInterface.getPath(0)</code> refers to ".../Label" and <code>oInterface.getPath(1)</code> refers to ".../Value". This means, the root formatter can access the ith part of the composite binding at will (since 1.31.0); see also {@link #.getInterface getInterface}. The function <code>foo</code> is called with arguments such that <code> oInterface.getModel(i).getObject(oInterface.getPath(i)) === arguments[i + 1]</code> holds. This use is not supported within an expression binding, that is, <code>&lt;Text text="{= ${parts: [{path: 'Label'}, {path: 'Value'}], formatter: 'foo'} }"/></code> does not work as expected because the property <code>requiresIContext = true</code> is ignored.

To distinguish those two use cases, just check whether <code>oInterface.getModel() === undefined</code>, in which case the formatter is called on root level of a composite binding. To find out the number of parts, probe for the smallest non-negative integer where <code>oInterface.getModel(i) === undefined</code>. This additional functionality is, of course, not available from {@link sap.ui.model.Context}, i.e. such formatters MUST be called with an instance of this context interface.

methods.description:
Returns a context interface for the indicated part in case of the root formatter of a composite binding. The new interface provides access to the original settings, but only to the model and path of the indicated part: <pre>
this.getInterface(i).getSetting(sName) === this.getSetting(sName);
this.getInterface(i).getModel() === this.getModel(i);
this.getInterface(i).getPath() === this.getPath(i);
</pre>

If a path is given, the new interface points to the resolved path as follows: <pre>
this.getInterface(i, "foo/bar").getPath() === this.getPath(i) + "/foo/bar";
this.getInterface(i, "/absolute/path").getPath() === "/absolute/path";
</pre> A formatter which is not at the root level of a composite binding can also provide a path, but must not provide an index: <pre>
this.getInterface("foo/bar").getPath() === this.getPath() + "/foo/bar";
this.getInterface("/absolute/path").getPath() === "/absolute/path";
</pre> Note that at least one argument must be present.

constructor.description:
XMLComposite is the base class for composite controls that use a XML fragment representation for their visual parts. From a user perspective such controls appear as any other control, but internally the rendering part is added as a fragment. The fragment that is used should appear in the same folder as the control's JS implementation with the file extension <code>.control.xml</code>. The fragment's content can access the interface data from the XMLComposite control via bindings. Currently only aggregations and properties can be used with bindings inside a fragment. The exposed model that is used for internal bindings in the fragment has the default name <code>$this</code>. The name will always start with an <code>$</code>. The metadata of the derived control can define the alias with its metadata. A code example can be found below.

As XMLComposites compose other controls, they are only invalidated and re-rendered if explicitly defined. Additional metadata for invalidation can be given for properties and aggregation. The default invalidation is <code>"none"</code>. Setting invalidate to <code>true</code> for properties and aggregations sets the complete XMLComposite to invalidate and rerender.</code>

Example: <pre>
XMLComposite.extend("sap.mylib.MyXMLComposite", {
  metadata : {
    library: "sap.mylib",
    properties : {
      text: { //changing this property will not re-render the XMLComposite
         type: "string",
         defaultValue: ""
      },
      title: { //changing this property will re-render the XMLComposite as it defines invalidate: true
         type: "string",
         defaultValue: "",
         invalidate: true
      },
      value: { //changing this property will re-render the XMLComposite as it defines invalidate: true
         type: "string",
         defaultValue: "",
         invalidate: true
      }
    },
    defaultProperty : "text",
    aggregations : {
      items : {
         type: "sap.ui.core.Control",
         invalidate: true
      },
      header : {
         type: "sap.mylib.FancyHeader",
         multiple : false
      }
    },
    defaultAggregation : "items"
    events: {
      outerEvent : {
        parameters : {
          opener : "sap.ui.core.Control"
        }
      }
    }
  },
  //alias defaults to "this"
  alias: "mycontrolroot" //inner bindings will use model name $mycontrolroot
  //fragment defaults to {control name}.control.xml in this case sap.mylib.MyXMLComposite.control.xml
  fragment: "sap.mylib.MyXMLCompositeOther.control.xml" //the name of the fragment
});
</pre>

Internally the XMLComposite instantiates and initializes the given fragment and stores the resulting control in a hidden aggregation named <code>_content</code>. The fragment should only include one root element.

Bindings of inner controls to the interface of the XMLComposite can be done with normal binding syntax. Here properties are used as property bindings and aggregations are used as list bindings. Currently it is not possible to bind associations in a fragment.

Example: <pre>
   &lt;core:FragmentDefinition xmlns:m="sap.m" xmlns:core="sap.ui.core"&gt;
      &lt;m:Text text="{$this&gt;text}" visible="{= ${$this&gt;text} !== ""}" /&gt;
   &lt;/core:FragmentDefinition&gt;
</pre> <pre>
   &lt;core:FragmentDefinition xmlns:m="sap.m" xmlns:core="sap.ui.core"&gt;
      &lt;m:VBox items="{path:"$this&gt;texts", filters:{path:"text", operator:"Contains", value1:"Text"}, sorter:{path:"text", descending:true}}"&gt;
          &lt;m:Text text="{$this&gt;text}" /&gt;
      &lt;/m:VBox&gt;
   &lt;/core:FragmentDefinition&gt;
</pre> <pre>
   &lt;core:FragmentDefinition xmlns:m="sap.m" xmlns:core="sap.ui.core"&gt;
      &lt;m:Button text="Press Me" press="handlePress"/&gt;
   &lt;/core:FragmentDefinition&gt;
</pre>

All events handled within the fragment will be dispatched to the XMLComposite control. It is recommended to follow this paradigm to allow reuse of a XMLComposite without any dependency to controller code of the current embedding view.

<pre>
   MyXMLComposite.prototype.handlePress = function() {
       this.fireOuterEvent(); // passing on the event to the outer view
   }
</pre>

Accepts an object literal <code>mSettings</code> that defines initial property values, aggregated and associated objects as well as event handlers. See {@link sap.ui.base.ManagedObject#constructor} for a general description of the syntax of the settings object.

symbols.description:
Event API for screen width changes.

This API is based on media queries but can also be used if media queries are not natively supported by the used browser. In this case, the behavior of media queries is simulated by this API.

There are several predefined {@link sap.ui.Device.media.RANGESETS range sets} available. Each of them defines a set of intervals for the screen width (from small to large). Whenever the screen width changes and the current screen width is in a different interval to the one before the change, the registered event handlers for the range set are called.

If needed, it is also possible to define a custom set of intervals.

The following example shows a typical use case: <pre>
function sizeChanged(mParams) {
    switch(mParams.name) {
        case "Phone":
            // Do what is needed for a little screen
            break;
        case "Tablet":
            // Do what is needed for a medium sized screen
            break;
        case "Desktop":
            // Do what is needed for a large screen
    }
}

// Register an event handler to changes of the screen size
sap.ui.Device.media.attachHandler(sizeChanged, null, sap.ui.Device.media.RANGESETS.SAP_STANDARD);
// Do some initialization work based on the current size
sizeChanged(sap.ui.Device.media.getCurrentRange(sap.ui.Device.media.RANGESETS.SAP_STANDARD));
</pre>

methods.description:
Sets the configuration for the UI5 loader. The configuration can be updated multiple times. Later changes do not impact modules that have been loaded before.

If no parameter is given, a partial copy of UI5 loader configuration in use is returned.

The configuration options are aligned with the "Common Config" draft of the AMD spec (https://github.com/amdjs/amdjs-api/blob/master/CommonConfig.md).

The following code shows an example of what a UI5 loader configuration might look like: <pre>

  sap.ui.loader.config({

    // location from where to load all modules by default
    baseUrl: '../../resources/',

    paths: {
      // load modules whose ID equals to or starts with 'my/module' from example.com
      'my/module': 'https://example.com/resources/my/module'
    },

    map: {
      // if any module requires 'sinon', load module 'sap/ui/thirdparty/sinon-4'
      '*': {
        'sinon': 'sap/ui/thirdparty/sinon-4'
      },
      // but if a module whose ID equals to or starts with 'app' requires 'sinon'
      // then load a legacy version instead
      "app": {
        'sinon': 'sap/ui/legacy/sinon'
      }
    },

    // activate real async loading and module definitions
    async: true,

    // provide dependency and export metadata for non-UI5 modules
    shim: {
      'sap/ui/thirdparty/blanket': {
        amd: true,
        exports: 'blanket'
      }
    }

  });

</pre>

symbols.description:
Provides and update the status data of a binding. Depending on the models state and controls state changes, the data state is used to propagated changes to a control. The control can react on these changes by implementing the <code>refreshDataState</code> method for the control. Here the data state object is passed as a parameter.

Using the {@link #getChanges getChanges} method the control can determine the changed properties and their old and new value. <pre>
    //sample implementation to handle message changes
    myControl.prototype.refreshDataState = function(oDataState) {
       var aMessages = oDataState.getChanges().messages;
       if (aMessages) {
           for (var i = 0; i &lt; aMessages.length; i++) {
               console.log(aMessages.message);
           }
       }
    }

    //sample implementation to handle laundering state
    myControl.prototype.refreshDataState = function(oDataState) {
       var bLaundering = oDataState.getChanges().laundering || false;
       this.setBusy(bLaundering);
    }

    //sample implementation to handle dirty state
    myControl.prototype.refreshDataState = function(oDataState) {
       if (oDataState.isDirty()) console.log("Control " + this.getId() + " is now dirty");
    }
</pre>

Using the {@link #getProperty getProperty} method the control can read the properties of the data state. The properties are <ul> <li><code>value</code> The value formatted by the formatter of the binding <li><code>originalValue</code> The original value of the model formatted by the formatter of the binding <li><code>invalidValue</code> The control value that was tried to be applied to the model but was rejected by a type validation <li><code>modelMessages</code> The messages that were applied to the binding by the <code>sap.ui.model.MessageModel</code> <li><code>controlMessages</code> The messages that were applied due to type validation errors <li><code>messages</code> All messages of the data state <li><code>dirty</code> true if the value was not yet confirmed by the server </ul>

methods.description:
Returns the changes of the data state in a map that the control can use in the <code>refreshDataState</code> method. The changed property's name is the key in the map. Each element in the map contains an object of below structure. <pre>
   {
       oldValue : The old value of the property,
       value    : The new value of the property
   }
</pre> The map only contains the changed properties.

