sap.ui.define(['sap/ui/model/Filter', 'sap/ui/model/FilterOperator'], function(Filter, FilterOperator) {
  new Filter({
    path: "Price",
    operator: FilterOperator.BT,
    value1: 11.0,
    value2: 23.0
  });
});

new sap.ui.model.Filter({
  path: "Price",
  test: function(oValue) {
     ...
  }
})

new Filter({
  filters: [
    ...
    new Filter({
      path: 'Quantity',
      operator: FilterOperator.LT,
      value1: 20
    }),
    new Filter({
      path: 'Price',
