methods.description:
Creates a property setting (which is either a constant value or a binding info object) from the given parts and from the optional root formatter function. Each part can have one of the following types: <ul> <li><code>boolean</code>, <code>number</code>, <code>undefined</code>: The part is a constant value.

<li><code>string</code>: The part is a data binding expression with complex binding syntax (for example, as created by {@link #.format format}) and is parsed accordingly to create either a constant value or a binding info object. Proper backslash escaping must be used for constant values with curly braces.

<li><code>object</code>: The part is a binding info object if it has a "path" or "parts" property, otherwise it is a constant value. </ul> If a binding info object is not the only part and has a "parts" property itself, then it must have no other properties except "formatter"; this is the case for expression bindings and data binding expressions created by {@link #.format format}.

If all parts are constant values, the resulting property setting is also a constant value computed by applying the root formatter function to the constant parts once. If at least one part is a binding info object, the resulting property setting is also a binding info object and the root formatter function will be applied again and again to the current values of all parts, no matter whether constant or variable.

Note: The root formatter function should not rely on its <code>this</code> value because it depends on how the function is called.

Note: A single data binding expression can be given directly to {@link sap.ui.base.ManagedObject#applySettings applySettings}, no need to call this function first.

Example: <pre>
function myRootFormatter(oValue1, oValue2, sFullName, sGreeting, iAnswer) {
    return ...; //TODO compute something useful from the given values
}

oSupplierContext = oMetaModel.getMetaContext("/ProductSet('HT-1021')/ToSupplier");
oValueContext = oMetaModel.createBindingContext("com.sap.vocabularies.UI.v1.DataPoint/Value", oSupplierContext);

vPropertySetting =  sap.ui.model.odata.AnnotationHelper.createPropertySetting([
    sap.ui.model.odata.AnnotationHelper.format(oValueContext),
    "{path : 'meta>Value', formatter : 'sap.ui.model.odata.AnnotationHelper.simplePath'}",
    "{:= 'Mr. ' + ${/FirstName} + ' ' + ${/LastName}}",
    "hello, world!",
    42
], myRootFormatter);

oControl.applySettings({"someProperty" : vPropertySetting});
</pre>

Returns the given OData type's property (not navigation property!) of given name.

If an array is given instead of a single name, it is consumed (via <code>Array.prototype.shift</code>) piece by piece. Each element is interpreted as a property name of the current type, and the current type is replaced by that property's type. This is repeated until an element is encountered which cannot be resolved as a property name of the current type anymore; in this case, the last property found is returned and <code>vName</code> contains only the remaining names, with <code>vName[0]</code> being the one which was not found.

Examples: <ul> <li> Get address property of business partner: <pre>
var oEntityType = oMetaModel.getODataEntityType("GWSAMPLE_BASIC.BusinessPartner"),
    oAddressProperty = oMetaModel.getODataProperty(oEntityType, "Address");
oAddressProperty.name === "Address";
oAddressProperty.type === "GWSAMPLE_BASIC.CT_Address";
</pre> </li> <li> Get street property of address type: <pre>
var oComplexType = oMetaModel.getODataComplexType("GWSAMPLE_BASIC.CT_Address"),
    oStreetProperty = oMetaModel.getODataProperty(oComplexType, "Street");
oStreetProperty.name === "Street";
oStreetProperty.type === "Edm.String";
</pre> </li> <li> Get address' street property directly from business partner: <pre>
var aParts = ["Address", "Street"];
oMetaModel.getODataProperty(oEntityType, aParts) === oStreetProperty;
aParts.length === 0;
</pre> </li> <li> Trying to get address' foo property directly from business partner: <pre>
aParts = ["Address", "foo"];
oMetaModel.getODataProperty(oEntityType, aParts) === oAddressProperty;
aParts.length === 1;
aParts[0] === "foo";
</pre> </li> </ul>

parameters.description:
A map containing the definition of batch groups for two-way binding changes. The map has the following format: <pre>
{
  "EntityTypeName": {
    batchGroupId: "ID",
    [changeSetId: "ID",]
    [single: true/false,]
  }
}
</pre> <ul> <li><code>batchGroupId</code>: Defines the batch group for changes of the defined <i>EntityTypeName</i></li> <li><code>changeSetId</code>: ID of a <code>ChangeSet</code> which bundles the changes for the entity type.</li> <li><code>single</code>: Defines if every change will get an own change set (defaults to <code>true</code>)</li> </ul>

A map containing the definition of batch groups for two-way binding changes. The map has the following format: <pre>
{
  "EntityTypeName": {
    groupId: "ID",
    [changeSetId: "ID",]
    [single: true/false,]
  }
}
</pre> <ul> <li><code>groupId</code>: Defines the group for changes of the defined <i>EntityTypeName</i></li> <li><code>changeSetId</code>: ID of a <code>ChangeSet</code> which bundles the changes for the entity type.</li> <li><code>single</code>: Defines if every change will get an own change set (defaults to <code>true</code>)</li> </ul>

symbols.description:
Tree binding implementation for OData models.

<h3>Hierarchy Annotations</h3> To use the v2.ODataTreeBinding with an OData service which exposes hierarchy annotations, see the <b>"SAP Annotations for OData Version 2.0"</b> specification. The required property annotations as well as accepted/default values are documented in this specification.

Services which include the <code>hierarchy-node-descendant-count-for</code> annotation and expose the data points sorted in a depth-first, pre-order manner, can use an optimized auto-expand feature by specifying the <code>numberOfExpandedLevels</code> in the binding parameters. This will pre-expand the hierarchy to the given number of levels, with only a single initial OData request.

For services without the <code>hierarchy-node-descendant-count-for</code> annotation, the <code>numberOfExpandedLevels</code> property is not supported and deprecated.

<h3>Navigation Properties</h3> <b>Note:</b> The use of navigation properties to build up the hierarchy structure is deprecated and it is recommended to use the hierarchy annotations mentioned above instead.

In addition to the hierarchy annotations, the <code>ODataTreeBinding</code> also supports (cyclic) references between entities based on navigation properties. They have to be specified with the binding parameter <code>navigation</code>. The value for that parameter has to be structured as a map object where the keys are entity names and the values are names of navigation properties.

Example: <pre>
  oTree.bindItems({

    path: "Employees",
    template: ...

	   parameters: {
      navigation: {
        "Employees": "toColleagues"
      }
    }
  });
</pre>

<h3>Operation Modes</h3> For a full definition and explanation of all OData binding operation modes see {@link sap.ui.model.odata.OperationMode}.

<h4>OperationMode.Server</h4> Filtering on the <code>ODataTreeBinding</code> is only supported with ({@link sap.ui.model.FilterType.Application application filters}). However please be aware that this applies only to filters which do not prevent the creation of a hierarchy. So filtering on a property (e.g. a "Customer") is fine, as long as the application can ensure that the responses from the backend are sufficient to create a valid hierarchy on the client. Subsequent paging requests for sibling and child nodes must also return responses since the filters will be sent with every request. Using control-defined filters ({@link sap.ui.model.FilterType.Control FilterType.Control}) via the <code>filter()</code> function is not supported for the operation mode <code>Server</code>.

<h4>OperationMode.Client and OperationMode.Auto</h4> The ODataTreeBinding supports control-defined filters only in operation modes <code>Client</code> and <code>Auto</code>. In these operation modes, the filters and sorters will be applied on the client, like for the <code>v2.ODataListBinding</code>.

The operation modes <code>Client</code> and <code>Auto</code> are only supported for services which expose the hierarchy annotations mentioned above, but do <b>not</b> expose the <code>hierarchy-node-descendant-count-for</code> annotation. Services with hierarchy annotations including the <code>hierarchy-node-descendant-count-for</code> annotation, do <b>not</b> support the operation modes <code>Client</code> and <code>Auto</code>.

examples.text:
oListBinding.setAggregation({
  aggregate : {
    AverageNetAmountInTransactionCurrency : {
      name : "NetAmountInTransactionCurrency", // original name
      with : "average" // aggregation method
    },
    NetAmountInDisplayCurrency : {subtotals : true}
  },
  group : {
    ProductCategory : {}, // optional
    TransactionCurrency : {}
  },
  groupLevels : ['ProductCategory']
});

methods.description:
QUnit test adapter for opa.js has the same signature as a test of QUnit. Suggested usage: <pre><code>
sap.ui.require(["sap/ui/test/Opa5", "sap/ui/test/opaQunit"], function (Opa5, opaTest) {

   Opa5.extendConfig({
       assertions: new Opa5({
           checkIfSomethingIsOk : function () {
               this.waitFor({
                   success: function () {
                       Opa5.assert.ok(true, "Everything is fine");
                   }
               });
           }
       })
   });

   opaTest("Should test something", function (Given, When, Then) {
      // Implementation of the test
      Then.checkIfSomethingIsOk();
   });

});
</code></pre>

When you require this file, it will also introduce a global variable: opaTest. It will also alter some settings of QUnit.config - testTimout will be increased to 90 if you do not specify your own. QUnit.reorder will be set to false, because OPA tests are often depending on each other.

parameters.description:
the object with the properties to be checked. Example: <pre>
// Would filter for an enabled control with the text "Accept".
new Properties({
    // The property text has the exact value "Accept"
    text: "Accept",
    // The property enabled also has to be true
    enabled: true
})
</pre> If the value is a RegExp, it tests the RegExp with the value. RegExp only works with string properties.

methods.description:
Extends and overwrites default values of the {@link sap.ui.test.Opa sap.ui.test.Opa.config} field. Sample usage: <pre>
    <code>
        var oOpa = new Opa();

        // this statement will time out after 15 seconds and poll every 400ms
        // those two values come from the defaults of sap.ui.test.Opa.config
        oOpa.waitFor({
        });

        // All wait for statements added after this will take other defaults
        Opa.extendConfig({
            timeout: 10,
            pollingInterval: 100
        });

        // this statement will time out after 10 seconds and poll every 100 ms
        oOpa.waitFor({
        });

        // this statement will time out after 20 seconds and poll every 100 ms
        oOpa.waitFor({
            timeout: 20;
        });
    </code>
</pre>

returnValue.description:
mPageObject The created page object. It will look like this: <pre><code>
 {
  &lt;your-page-object-name&gt; : {
      actions: // an instance of baseClass or Opa5 with all the actions defined above
      assertions: // an instance of baseClass or Opa5 with all the assertions defined above
  }
 }
</code></pre>

viewName.description:
When a viewName is given, all waitFors inside of the page object will get a viewName parameter. Here is an example: <pre>
		<code>
			Opa5.createPageObjects({
				viewName: "myView",
				onMyPageWithViewName: {
					assertions: {
						iWaitForAButtonInMyView: function () {
							this.waitFor({
								id: "myButton",
								success: function (oButton) {
									// the button is defined in the view myView
								}
							});
						}
					}
				}
    </code>
</pre> This saves you repeating the viewName in every waitFor statement of the page object. It is possible to overwrite the viewName of the page object in a specific waitFor. So if you have specified a <code>viewName: "myView"</code> in your page object and you want to look for a control with a global id you may use <code>viewName: ""</code> in a waitFor to overwrite the viewName of the page Object. Example: <pre>
		<code>
			this.waitFor({
				id: "myButton",
				viewName: "",
				success: function (oButton) {
					// now a button with the global id "myButton" will be searched
				}
			});
		</code>
</pre>

methods.description:
Extends and overwrites default values of the {@link sap.ui.test.Opa.config}. Most frequent usecase: <pre>
    <code>
        // Every waitFor will append this namespace in front of your viewName
        Opa5.extendConfig({
           viewNamespace: "namespace.of.my.views."
        });

        var oOpa = new Opa5();

        // Looks for a control with the id "myButton" in a View with the name "namespace.of.my.views.Detail"
        oOpa.waitFor({
             id: "myButton",
             viewName: "Detail"
        });

        // Looks for a control with the id "myList" in a View with the name "namespace.of.my.views.Master"
        oOpa.waitFor({
             id: "myList",
             viewName: "Master"
        });
    </code>
</pre>

Sample usage: <pre>
    <code>
        var oOpa = new Opa5();

        // this statement will  will time out after 15 seconds and poll every 400ms.
        // those two values come from the defaults of {@link sap.ui.test.Opa.config}.
        oOpa.waitFor({
        });

        // All wait for statements added after this will take other defaults
        Opa5.extendConfig({
            timeout: 10,
            pollingInterval: 100
        });

        // this statement will time out after 10 seconds and poll every 100 ms
        oOpa.waitFor({
        });

        // this statement will time out after 20 seconds and poll every 100 ms
        oOpa.waitFor({
            timeout: 20;
        });
    </code>
</pre>

id.description:
The global ID of a control, or the ID of a control inside a view. If a regex and a viewName is provided, Opa5 will only look for controls in the view with a matching ID.<br/> Example of a waitFor: <pre>
    <code>
        this.waitFor({
            id: /my/,
            viewName: "myView"
        });
    </code>
</pre> The view that is searched in: <pre>
    <code>
        &lt;core:View xmlns:core="sap.ui.core" xmlns="sap.m"&gt;
            &lt;Button id="myButton"&gt;
            &lt;/Button&gt;
            &lt;Button id="bar"&gt;
            &lt;/Button&gt;
            &lt;Button id="baz"&gt;
            &lt;/Button&gt;
            &lt;Image id="myImage"&gt;&lt;/Image&gt;
        &lt;/core:View&gt;
    </code>
</pre> Will result in matching two controls, the image with the effective ID myView--myImage and the button myView--myButton. Although the IDs of the controls myView--bar and myView--baz contain a my, they will not be matched since only the part you really write in your views will be matched.

controlType.description:
Selects all control by their type. It is usually combined with a viewName or searchOpenDialogs. If no control is matching the type, an empty array will be returned. Here are some samples: <code> <pre>
        this.waitFor({
            controlType: "sap.m.Button",
            success: function (aButtons) {
                // aButtons is an array of all visible buttons
            }
        });

        // control type will also return controls that extend the control type
        // this will return an array of visible sap.m.List and sap.m.Table since both extend List base
        this.waitFor({
            controlType: "sap.m.ListBase",
            success: function (aLists) {
                // aLists is an array of all visible Tables and Lists
            }
        });

        // control type is often combined with viewName - only controls that are inside of the view
        // and have the correct type will be returned
        this.waitFor({
            viewName: "my.View"
            controlType: "sap.m.Input",
            success: function (aInputs) {
                // aInputs are all sap.m.Inputs inside of a view called 'my.View'
            }
        });
    </pre> </code>

actions.description:
Available since 1.34.0. An array of functions or Actions or a mixture of both. An action has an 'executeOn' function that will receive a single control as a parameter. If there are multiple actions defined all of them will be executed (first in first out) on each control of, similar to the matchers. Here is one of the most common usages: <code> function (sButtonId) { // executes a Press on a button with a specific id new Opa5().waitFor({ id: sButtonId, actions: new Press() }); }; </code> But actions will only be executed once and only after the check function returned true. Before actions are executed the {@link sap.ui.test.matchers.Interactable} matcher and the internal autoWait logic will check if the Control is currently able to perform actions if it is not, Opa5 will try again after the 'pollingInterval'. That means actions will only be executed if: <ul> <li> Controls and their parents are visible, enabled and not busy </li> <li> The controls are not hidden behind static elements such as dialogs </li> <li> There is no pending asynchronous work performed by the application </li> </ul> If there are multiple controls in Opa5's result set the action will be executed on all of them. The actions will be invoked directly before success is called. In the documentation of the success parameter there is a list of conditions that have to be fulfilled. They also apply for the actions. There are some predefined actions in the {@link sap.ui.test.actions} namespace. since 1.42 an Action may add other waitFors. The next action or the success handler will not be executed until the waitFor of the action has finished. An example: <code> <pre>
    this.waitFor({
        id: "myButton",
        actions: function (oButton) {
           // this action is executed first
           this.waitFor({
             id: "anotherButton",
             actions: function () {
               // This is the second function that will be executed
               // Opa will also wait until anotherButton is Interactable before executing this function
             },
             success: function () {
               // This is the third function that will be executed
             }
           })
        },
        success: function () {
            // This is the fourth function that will be executed
        }
    });
    </pre> </code> Executing multiple actions will not wait between actions for a control to become "Interactable" again. If you need waiting between actions you need to split the actions into multiple 'waitFor' statements.

autoWait.description:
@since 1.42 Only has an effect if set to true. Since 1.53 it can also be a plain object. The waitFor statement will not execute success callbacks as long as there is pending asynchronous work such as for example: open XMLHTTPRequests (requests to a server), scheduled delayed work and promises, unfinished UI navigation. In addition, the control must be {@link sap.ui.test.matchers.Interactable} So when autoWait is enabled, success behaves like an action in terms of waiting. It is recommended to set this value to true for all your waitFor statements using: <code> <pre>
    Opa5.extendConfig({
        autoWait: true
    });
    </pre> </code> Why is it recommended: When writing a huge set of tests and executing them frequently you might face tests that are sometimes successful but sometimes they are not. Setting the autoWait to true should stabilize most of those tests. The default "false" could not be changed since it causes existing tests to fail. There are cases where you do not want to wait for controls to be "Interactable": For example when you are testing the Busy indication of your UI during the sending of a request. But these cases are the exception so it is better to explicitly adding autoWait: false to this waitFor. <code> <pre>
    this.waitFor({
        id: "myButton",
        autoWait: false,
        success: function (oButton) {
             Opa5.assert.ok(oButton.getBusy(), "My Button was busy");
        }
    });
    </pre> </code> This is also the easiest way of migrating existing tests. First extend the config, then see which waitFors will time out and finally disable autoWait in these Tests.

controlType.description:
@since 1.40 Selects all control by their type. It is usually combined with viewName or searchOpenDialogs. If no control is matching the type, an empty array will be returned. Here are some samples: <code> <pre>
        // will return an array of all visible buttons
        new OpaPlugin().getMatchingControls({
            controlType: "sap.m.Button"
        });

        // control type will also return controls that extend the control type
        // this will return an array of visible sap.m.List and sap.m.Table since both extend List base
        new OpaPlugin().getMatchingControls({
            controlType: "sap.m.ListBase"
        });

        // control type is often combined with viewName - only controls that are inside of the view
        // and have the correct type will be returned
        // here all sap.m.Inputs inside of a view called 'my.View' will be returned
        new OpaPlugin().getMatchingControls({
            viewName: "my.View"
            controlType: "sap.m.Input"
        });
    </pre> </code>
